  {priority_id: 10001, event_date: "2013-11-11 10:00:49", description: "CALCINAN VEHICULO CON REPORTE DE ROBO ", address: "AV VENCEREMOS", suburb: "PEDRO DOMINGUEZ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Según fuentes de los medios electrónicos el día 11 de noviembre del 2013 aproximadamente a las 20:00 hrs. Se dio el reporte de un vehículo incinerado en el interior de un arroyo de la avenida venceremos. Dicho vehículo al parecer es el mismo que utilizaron  para la agresión que tuvo lugar frente al panteón de la colonia san Jorge, donde resultaron cuatro personas lesionadas por proyectil de arma de fuego. Los nombres de las víctimas de la agresión son: Adela portillo López de 44 años de edad, mercedes Martínez cano de 73 años de edad, Maribel Nájera Martínez de 43 años de edad y Raúl alcantar Díaz de 45 años de edad. Bajo la carpeta de investigación # 17735/2013 la cual se vincula con la carpeta #17631/2013 por el robo de vehículo con violencia con fecha del evento 08/11/2013.", backup_file: nil, source: "http://tiempo.com.mx/_notas/1614050", area_id: 10001, crime_id: 39, township_id: 14, locality_id: 3362, place_id: nil, analyst_id: 27, status_id: 10023, longitude: "-106.11582219600677", latitude: "28.75190510021558", gmaps: nil, tramo_carretero: nil, searchable: "  CALCINAN VEHICULO CON REPORTE DE ROBO  AV VENCEREMOS Chihuahua Centro ROBO DE VEHICULO  CALCINAN VEHICULO CON REPORTE DE ROBO  AV VENCEREMOS Chihuahua Centro ROBO DE VEHICULO  CALCINAN VEHICULO CON REPORTE DE ROBO  AV VENCEREMOS Chihuahua Centro ROBO DE VEHICULO  CALCINAN VEHICULO CON REPORTE DE ROBO  AV VENCEREMOS Chihuahua Centro ROBO DE VEHICULO ", raw_rnum_: 8},
