  {priority_id: 10000, event_date: "2013-11-12 22:31:37", description: "HOMICIDIO PUNZOCORTANTE ", address: "BETECHI 510", suburb: "LOMAS KARIKE", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Según medios digitales informan que la madrugada de este miércoles se presentó un macabro hallazgo al ser localizado el cuerpo sin vida de un menor encobijado en las inmediaciones de la colonia Unidad Karike, al parecer la víctima tenía reporte de desaparición. \r\n\r\n El hecho fue reportado por vecinos de la citada colonia, quienes observaron a una persona sin vida encobijada en el cruce de las calles José Martí y Betechi, frente al número 508, hecho que movilizo a unidades de la Policía Municipal, Única Estatal y de la Fiscalía General del Estado. Extraoficialmente se dio a conocer que la víctima contaba con 15 años de edad y fue identificado como Brayan Alexis García Olivas, quien contaba con reporte de desaparición y al parecer con antecedentes penales por robo a casa habitación y presuntamente estaba sujeto a proceso por ese mismo delito.\r\n \r\nAl lugar acudieron autoridades ministeriales para realizar la investigación correspondiente y trasladar el cuerpo a las instalaciones del C4, para realizarle la necropsia de Ley.\r\n", backup_file: nil, source: "http://eldiariodechihuahua.mx/notas.php?seccion=Seguridad&f=2013/11/13&id=e8ccbe133af05373ec3f8f91d41c3ed2", area_id: 10001, crime_id: 1, township_id: 14, locality_id: 3362, place_id: nil, analyst_id: 37, status_id: 10023, longitude: "-106.10816717147833", latitude: "28.677038774280557", gmaps: nil, tramo_carretero: nil, searchable: "  HOMICIDIO PUNZOCORTANTE  BETECHI 510 Chihuahua Centro HOMICIDIO  HOMICIDIO PUNZOCORTANTE  BETECHI 510 Chihuahua Centro HOMICIDIO  HOMICIDIO PUNZOCORTANTE  BETECHI 510 Chihuahua Centro HOMICIDIO  HOMICIDIO PUNZOCORTANTE  BETECHI 510 Chihuahua Centro HOMICIDIO ", raw_rnum_: 10},
