  {priority_id: 10001, event_date: "2014-02-07 16:09:16", description: "EJECUTADO CERCA DE LA ESCUELA PRIMARIA FRANCISCO VILLA, UBICADA EN EL CRUCE DE EJE VIAL JUAN GABRIEL Y CALLE PAVO REAL", address: "EJE VIAL JUAN GABRIEL Y PAVO REAL", suburb: nil, locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "LA PERSONA FUE IDENTIFICADA COMO EDUARDO LEGUíA, DE 30 AñOS\r\nDurante la tarde del viernes un sujeto fue ejecutado en la Colonia Francisco Villa, en donde se ubican un Jardín de Niños y una primaria.\r\nCabe mencionar, que según testigos de los hechos sangrientos fueron sujetos armados a bordo de una camioneta color gris Liberty, y le dispararon en varias ocasiones a quien identificaron como Eduardo Leguía de 30 años. En este sentido, se informó que el hombre vivía en esta misma colonia en la calle Privada 2 de Octubre en donde quedó tendido.", backup_file: nil, source: "http://diario.mx/Local/2014-02-09_2977a2ee/con-8-ejecutados-se-registra-aqui-fin-de-semana-mas-violento-del-ano", area_id: 10000, crime_id: 1, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.44580364227295", latitude: "31.669271107743", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE EJECUTADO CERCA DE LA ESCUELA PRIMARIA FRANCISCO VILLA, UBICADA EN EL CRUCE DE EJE VIAL JUAN GABRIEL Y CALLE PAVO REAL EJE VIAL JUAN GABRIEL Y PAVO REAL Juárez NORTE HOMICIDIO LA PERSONA FUE IDENTIFICADA COMO EDUARDO LEGUíA, DE 30 AñOS A0-MEDIOS-NORTE EJECUTADO CERCA DE LA ESCUELA PRIMARIA FRANCISCO VILLA, UBICADA EN EL CRUCE DE EJE VIAL JUAN GABRIEL Y CALLE PAVO REAL EJE VIAL JUAN GABRIEL Y PAVO REAL Juárez NORTE HOMICIDIO LA PERSONA FUE IDENTIFICADA COMO EDUARDO LEGUíA, DE 30 AñOS A036 EJECUTADO CERCA DE LA ESCUELA PRIMARIA FRANCISCO VILLA, UBICADA EN EL CRUCE DE EJE VIAL JUAN GABRIEL Y CALLE PAVO REAL EJE VIAL JUAN GABRIEL Y