  {priority_id: 10001, event_date: "2014-01-27 16:18:00", description: "CAEN ASALTANTES CON ARMAMENTO ", address: nil, suburb: "15 ENERO ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Asi mismo se les aseguro Revolver Smith y Weon calibre .38  pistola escuadra calibre 8mm Marca Lady K con cartucho, pistola escuadra de utilería Marca Walther calibre 4.5 mm, 33 cartuchos calibre .22, 17 cartuchos 9mm, 2 cartuchos 7.62 x 51, 3 cartuchos calibre .25 y 6 pasamontañas.", backup_file: nil, source: nil, area_id: 10001, crime_id: 37, township_id: 14, locality_id: nil, place_id: nil, analyst_id: 5, status_id: 10023, longitude: "-105.98103046417236", latitude: "28.61319570487009", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS CAEN ASALTANTES CON ARMAMENTO   Centro ROBO  A0-MEDIOS CAEN ASALTANTES CON ARMAMENTO  Centro ROBO  A0-MEDIOS CAEN ASALTANTES CON ARMAMENTO  Centro ROBO Asi mismo se les aseguro Revolver Smith y Weon calibre .38  pistola escuadra calibre 8mm Marca Lady K con cartucho, pistola escuadra de utilería Marca Walther calibre 4.5 mm, 33 cartuchos calibre .22, 17 cartuchos 9mm, 2 cartuchos 7.62 x 51, 3 cartuchos calibre .25 y 6 pasamontañas. A005 CAEN ASALTANTES CON ARMAMENTO  Centro ROBO Asi mismo se les aseguro Revolver Smith y Weon calibre .38  pistola escuadra calibre 8mm Marca Lady K con cartucho, pistola escuadra de utilería Marca Walther calibre 4.5 mm, 33 cartuchos calibre .22, 17 cartuchos 9mm, 2 cartuchos 7.62 x 51, 3 cartuchos calibre .25 y 6 pasamontañas. A005 CAEN ASALTANTES CON ARMAMENTO  CENTRO ROBO Asi mismo se les aseguro Revolver Smith y Weon calibre .38  pistola escuadra calibre 8mm Marca Lady K con cartucho, pistola escuadra de utilería Marca Walther calibre 4.5 mm, 33 cartuchos calibre .22, 17 cartuchos 9mm, 2 cartuchos 7.62 x 51, 3 cartuchos calibre .25 y 6 pasamontañas.", raw_rnum_: 224},
  {priority_id: 10001, event_date: "2014-02-01 20:17:31", description: "Viajaban en Hummer a exceso de velocidad; les hallan una pistola\r\n\r\nTres hombres y una mujer que viajaban a exceso de velocidad en un vehículo Hummer fueron detenidos por elementos de las células mixtas, quienes les encontraron una pistola escuadra calibre .45 con tres balas.\r\n\r\nLos cuatro sospechosos fueron arrestados ayer a las 18:20 horas en Óscar Flores y Teófilo Borunda de la colonia El Vergel, cuando los policías vieron una camioneta Hummer, modelo 2005 y de color gris, que circulaba a exceso de velocidad, agregó.\r\n\r\n Al detenerlos y someterlos a revisión, en el interior de la camioneta se encontró una pistola escuadra calibre .45 con un cargador abastecido con tres cartuchos, continuó.\r\n\r\n ", address: "Óscar Flores y Teófilo Borunda ", suburb: "el vergel", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "\r\n\r\nAsí fueron puestos bajo arresto Silvano Débora Simental de 32 años, Francisco Daniel Hernández de 25, Héctor Terrazas Fierro de 22 y Maura Fabiola Cadena Luna de 21\r\n", backup_file: nil, source: "http://diario.mx/Local/2014-01-30_524a6e39/viajaban-en-hummer-a-exceso-de-velocidad-les-hallan-una-pistola", area_id: 10000, crime_id: 120, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 35, status_id: 10023, longitude: "-106.44061088562012", latitude: "31.694908076561198", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE ASALTAN REFACCIONARIA EN LA EX HIPóDROMO; LOS DETIENEN\r\nDOS PRESUNTOS ASALTANTES FUERON APREHENDIDOS POR ELEMENTOS DE LA POLICíA MUNICIPAL ACUSADOS DE DESPOJAR DE DINERO Y SUS PERTENENCIAS A LOS EMPLEADOS DE UNA REFACCIONARIA UBICADA EN LA COLONIA EX HIPóDROMO, LA TARDE DEL LUNES.\r\n\r\n ADRIáN SáNCHEZ CONTRERAS, VOCERO DE LA SECRETARíA DE SEGURIDAD PúBLICA MUNICIPAL (SSPM), DIO A CONOCER QUE LOS HECHOS OCURRIERON EN EL NEGOCIO UBICADO EN AVENIDA DE LOS INSURGENTES Y PARAGUAY.\r\n\r\n AGENTES QUE REALIZABAN UN RECORRIDO DE VIGILANCIA FUERON INTERCEPTADOS POR DOS EMPLEADOS DE LA REFACCIONARIA, QUIENES DIJERON QUE MINUTOS ANTES DOS SUJETOS LOS ASALTARON CON UNA PISTOLA Y HUYERON A TODA VELOCIDAD EN UN AUTOMóVIL NISSAN TSURU, DE COLOR GRIS Y DE MODELO ANTIGUO, CONTINUó.\r\n AVENIDA DE LOS INSURGENTES Y PARAGUAY Juárez NORTE PORTACION DE ARMA DE FUEGO LOS DETENIDOS FUERON IDENTIFICADOS COMO RAúL ALFONSO LóPEZ MARCIAL, DE 24 AñOS, E ISAAC EDUARDO RANGEL CORTEZ, DE 29.\r\n\r\n SE LES ASEGURó EN EL VEHíCULO QUE VIAJABAN UN ARMA DE FUEGO TIPO ESCUADRA CALIBRE .380 CON UN CARGADOR ABASTECIDO CON CUATRO CARTUCHOS Y DOS TELéFONOS CELULARES PROPIEDAD DE LOS AFECTADOS, DIO A CONOCER LA SECRETARíA DE SEGURIDAD PúBLICA MUNICIPAL.\r\n\r\n AMBOS FUERON LLEVADOS A LA ESTACIóN DE POLICíA DEL DISTRITO UNIVERSIDAD Y DE ALLí SE LES CONSIGNó ANTE EL MINISTERIO PúBLICO PARA QUE DETERMINE SU RESPONSABILIDAD EN LOS DELITOS DE ROBO CON VIOLENCIA Y PORTACIóN ILEGAL DEL ARMA DE FUEGO A0-MEDIOS-NORTE ASALTAN REFACCIONARIA EN LA EX HIPóDROMO; LOS DETIENEN\r\nDOS PRESUNTOS ASALTANTES FUERON APREHENDIDOS POR ELEMENTOS DE LA POLICíA MUNICIPAL ACUSADOS DE DESPOJAR DE DINERO Y SUS PERTENENCIAS A LOS EMPLEADOS DE UNA REFACCIONARIA UBICADA EN LA COLONIA EX HIPóDROMO, LA TARDE DEL LUNES.\r\n\r\n ADRIáN SáNCHEZ CONTRERAS, VOCERO DE LA SECRETARíA DE SEGURIDAD PúBLICA MUNICIPAL (SSPM), DIO A CONOCER QUE LOS HECHOS OCURRIERON EN EL NEGOCIO UBICADO EN AVENIDA DE LOS INSURGENTES Y PARAGUAY.\r\n\r\n AGENTES QUE REALIZABAN UN RECORRIDO DE VIGILANCIA FUERON INTERCEPTADOS POR DOS EMPLEADOS DE LA REFACCIONARIA, QUIENES DIJERON QUE MINUTOS ANTES DOS SUJETOS LOS ASALTARON CON UNA PISTOLA Y HUYERON A TODA VELOCIDAD EN UN AUTOMóVIL NISSAN TSURU, DE COLOR GRIS Y DE MODELO ANTIGUO, CONTINUó.\r\n AVENIDA DE LOS INSURGENTES Y PARAGUAY Juárez NORTE PORTACION DE ARMA DE FUEGO LOS DETENIDOS FUERON IDENTIFICADOS C