  {priority_id: 10002, event_date: "2014-02-01 17:04:31", description: "EJECUTAN A HOMBRE CAMINO A SANTA EULALIA", address: nil, suburb: nil, locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "", backup_file: nil, source: "http://www.tiempo.com.mx/_notas/1695871", area_id: 10001, crime_id: 1, township_id: nil, locality_id: nil, place_id: nil, analyst_id: 10020, status_id: 10023, longitude: "-105.93154907226562", latitude: "28.582712848295753", gmaps: nil, tramo_carretero: "CARRETERA CHIHUAHUA - SANTA EULALIA KM 6.0", searchable: "  SuperAdmin EJECUTAN A HOMBRE CAMINO A SANTA EULALIA  CENTRO HOMICIDIO ", raw_rnum_: 237},
  {priority_id: 10001, event_date: "2014-02-06 17:53:44", description: "EJECUTAN A HOMBRE A BORDO DE BMW\r\n\r\nMiguel Ángel Agüero Miranda, quien fue asesinado a balazos el jueves pasado en Ciudad Juárez, al parecer era buscado en Estados Unidos por la DEA (Drug Enforcement Administration), en el área de St. Louis, acusado de conspiración para distribuir metanfetamina.\r\n\r\nLa Fiscalía General del Estado informó que Agüero Miranda tenía 52 años de edad.\r\n\r\nEl asesinato de Miguel Ángel Agüero ocurrió la tarde del jueves, en un negocio de carrocería y desponchado que se ubica en el cruce de las calles Hermanos Escobar y Uruguay, en la colonia Partido Romero, en Ciudad Juárez.\r\n\r\nLa víctima se encontraba a bordo de un carro marca BMW, línea 323I, color azul marino.\r\n\r\nEl cadáver de Agüero Miranda quedó con impactos de bala en varias partes del cuerpo.\r\n\r\nAl lugar del crimen llegaron policías de las diferentes corporaciones, pero fue el personal de la Fiscalía Zona Norte quien se encargó del caso.\r\n\r\nPosteriormente la autoridad logró identificar el cadáver y, de acuerdo con información que aparece, Agüero Miranda era buscado por la DEA y se ofrecía una recompensa por su captura.\r\n", address: "URUGUAY CRUCE CON HERMANOS ESCOBAR ", suburb: "PARTIDO ROMERO", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Miguel Ángel Agüero Miranda, quien fue asesinado a balazos el jueves pasado en Ciudad Juárez, al parecer era buscado en Estados Unidos por la DEA (Drug Enforcement Administration), en el área de St. Louis, acusado de conspiración para distribuir metanfetamina.\r\n\r\nLa Fiscalía General del Estado informó que Agüero Miranda tenía 52 años de edad.\r\n\r\nEl asesinato de Miguel Ángel Agüero ocurrió la tarde del jueves, en un negocio de carrocería y desponchado que se ubica en el cruce de las calles Hermanos Escobar y Uruguay, en la colonia Partido Romero, en Ciudad Juárez.\r\n\r\nLa víctima se encontraba a bordo de un carro marca BMW, línea 323I, color azul marino.\r\n\r\nEl cadáver de Agüero Miranda quedó con impactos de bala en varias partes del cuerpo.\r\n\r\nAl lugar del crimen llegaron policías de las diferentes corporaciones, pero fue el personal de la Fiscalía Zona Norte quien se encargó del caso.\r\n\r\nPosteriormente la autoridad logró identificar el cadáver y, de acuerdo con información que aparece, Agüero Miranda era buscado por la DEA y se ofrecía una recompensa por su captura.\r\n", backup_file: nil, source: "http://puentelibre.mx/_notas/1550050", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.47080183029175", latitude: "31.74148933097696", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS EJECUTAN A HOMBRE A BORDO DE BMW URUGUAY CRUCE CON HERMANOS ESCOBAR  NORTE HOMICIDIO  A0-MEDIOS EJECUTAN A HOMBRE A BORDO DE BMW URUGUAY CRUCE CON HERMANOS ESCOBAR  NORTE HOMICIDIO  A036 EJECUTAN A HOMBRE A BORDO DE BMW URUGUAY CRUCE CON HERMANOS ESCOBAR  NORTE HOMICIDIO ", raw_rnum_: 238},
  {priority_id: 10001, event_date: "2014-02-17 18:59:23", description: "DESMANTELA VIVIENDA DONDE EMPACABAN MARIHUANA Y DETEENEN  A JOVEN", address: "SIERRA MADRE OCCIDENTAL Y OSCAR FLORES", suburb: "LOMAS DE SAN JOSÉ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "ELEMENTOS PERTENECIENTES A CÉLULAS MIXTAS LOGRARON DESMANTELAR UN DOMICILIO QUE UTILIZABAN PARA EMPAQUETAR MARIHUANA \r\nEn dos intervenciones, agentes que participan en los operativos de las células mixtas, aseguraron cerca de media tonelada de mariguana, la mitad de ella en una “casa de seguridad” donde se empaquetaba la droga, informaron portavoces de la Secretaría de Seguridad Pública municipal.\r\n\r\n A este último lugar, los policías llegaron por la tarde de este lunes luego de detectar en la calle a un hombre con una pistola fajada en la cintura, el cual se refugió en el domicilio de la calle Sierra Madre Occidental y Óscar Flores, en la colonia Lomas de San José.\r\n\r\n Al perseguirlo, el hombre arrestado se identificó como Jonathan Eduardo Ortega Cuellar, de 21 años de edad, quien condujo a los agentes al interior de la vivienda donde se localizaron dos cuadros grandes de 13 kilos de mariguana cada uno, 244 paquetes tipo cilindro con la misma droga, 53 de ellos envueltos con cinta color canela y tres bolsas del enervante en greña.\r\n\r\n En el lugar también se localizaron cuatro gatos hidráulicos, cuatro básculas, cinco selladoras para empacar al vacío, un garrafón con gasolina, cuatro cajas con bolsas de polietileno.\r\n\r\n Ortega Cuellar, quien portaba en la cintura un revólver calibre .357 magnum, con un cartucho útil, será consignado en las próximas horas ante el Ministerio Público Federal. \r\n\r\n Casi al mismo tiempo, en la colonia El Granjero, la conductora de una pick up Toyota, Tundra, cabina y media, modelo 2004, intentó evadir a los agentes que participan en las células mixtas y aceleró su vehículo.\r\n\r\n La mujer identificada como María Elena Alcalá Baca, de 33 años de edad, arribó  a un domicilio ubicado en la calle Centeno y Cañaveral, donde fue sometida a una revisión.\r\n\r\n En el interior de la camioneta se localizaron 628 paquetes de mariguana que pesaron poco más de 300 kilos los cuales serán turnados junto con la arrestada al Ministerio Público Federal.\r\n", backup_file: nil, source: "http://diario.mx/Local/2014-02-17_4ff76e96/aseguran-cerca-de-media-tonelada-de-mariguana-en-2-intervenciones/", area_id: 10000, crime_id: 130, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.4375638961792", latitude: "31.67803667986352", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE DESMANTELA VIVIENDA DONDE EMPACABAN MARIHUANA Y DETEENEN  A JOVEN SIERRA MADRE OCCIDENTAL Y OSCAR FLORES Juárez NORTE CONTRA LA SALUD ELEMENTOS PERTENECIENTES A CÉLULAS MIXTAS LOGRARON DESMANTELAR UN DOMICILIO QUE UTILIZABAN PARA EMPAQUETAR MARIHUANA  A0-MEDIOS-NORTE DESMANTELA VIVIENDA DONDE EMPACABAN MARIHUANA Y DETEENEN  A JOVEN SIERRA MADRE OCCIDENTAL Y OSCAR FLORES Juárez NORTE CONTRA LA SALUD ELEMENTOS PERTENECIENTES A CÉLULAS MIXTAS LOGRARON DESMANTELAR UN DOMICILIO QUE UTILIZABAN PARA EMPAQUETAR MARIHUANA  A036 DESMANTELA VIVIENDA DONDE EMPACABAN MARIHUANA Y DETEENEN  A JOVEN SIERRA MADRE OCCIDENTAL Y OSCAR FLORES Juárez NORTE CONTRA LA SALUD ELEMENTOS PERTENECIENTES A CÉLULAS MIXTAS LOGRARON DESMANTELAR UN DOMICILIO QUE UTILIZABAN PARA EMPAQUETAR MARIHUANA ", raw_rnum_: 239},
