  {priority_id: 10001, event_date: "2014-02-07 18:51:01", description: "EJECUTAN A SUJETO EN LA FRANCISCO VILLA", address: "PRIVADA DE 2 DE OCTUBRE", suburb: "FRANCISCO VILLA", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "SUJETOS ARMADOS A BORDO DE UNA CAMIONETA COLOR GRIS LIBERTY LE DISPARARON  EN VARIAS OCASIONES A LA VÍCTIMA\r\n\r\nDurante la tarde del viernes un sujeto fue ejecutado en la Colonia Francisco Villa, en donde se ubican un Jardín de Niños y una primaria.\r\nCabe mencionar, que según testigos de los hechos sangrientos fueron sujetos armados a bordo de una camioneta color gris Liberty, y le dispararon en varias ocasiones a quien identificaron como Eduardo Leguía de 30 años. \r\n\r\nEn este sentido, se informó que el hombre vivía en esta misma colonia en la calle Privada 2 de Octubre en donde quedó tendido. \r\n", backup_file: nil, source: "http://www.pendulo.mx/noticias.cfm?n=63729", area_id: 10000, crime_id: 1, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.44454836845398", latitude: "31.66842189898633", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE EJECUTAN A SUJETO EN LA FRANCISCO VILLA PRIVADA DE 2 DE OCTUBRE Juárez NORTE HOMICIDIO SUJETOS ARMADOS A BORDO DE UNA CAMIONETA COLOR GRIS LIBERTY LE DISPARARON  EN VARIAS OCASIONES A LA VÍCTIMA A0-MEDIOS-NORTE EJECUTAN A SUJETO EN LA FRANCISCO VILLA PRIVADA DE 2 DE OCTUBRE Juárez NORTE HOMICIDIO SUJETOS ARMADOS A BORDO DE UNA CAMIONETA COLOR GRIS LIBERTY LE DISPARARON  EN VARIAS OCASIONES A LA VÍCTIMA A036 EJECUTAN A SUJETO EN LA FRANCISCO VILLA PRIVADA DE 2 DE OCTUBRE Juárez NORTE HOMICIDIO SUJETOS ARMADOS A BORDO DE UNA CAMIONETA COLOR GRIS LIBERTY LE DISPARARON  EN VARIAS OCASIONES A LA VÍCTIMA", raw_rnum_: 254},
  {priority_id: 10001, event_date: "2014-02-11 18:34:56", description: "ARRESTAN A DIRECTOR DE CENTRO DE REHABILITACIÓN POR MUERTE DE INTERNO", address: "MANUEL GOMEZ MORIN", suburb: nil, locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "LA VÍCTIMA FUE AMARRADO Y GOLPEADO HASTA MORIR TRAS SUFRIR UN ATAQUE DE ANSIEDAD POR FALTA DE ALCOHOL EN EL CENTRO DE REHABILITACIÓN ANDAR\r\n\r\nEl director de un centro de rehabilitación y dos de sus ayudantes, fueron aprehendidos por agentes de la Fiscalía General del Estado acusados de asesinar a un interno con problemas de alcoholismo. Se trata de Óscar Ruvalcaba Madrid, de 24 años de edad y sus ayudantes Pablo Carrillo de 27 años de edad y José Luis Moreno Rivera, de 30 años de edad, informaron portavoces de la dependencia estatal. La víctima identificada como César Rubio fue amarrado y golpeado hasta morir tras sufrir un ataque de ansiedad por falta de alcohol. Los hechos ocurrieron en el interior del Centro de Rehabilitación ANDAR ubicado en la avenida Manuel Gómez Morin el pasado 16 de noviembre del 2013. Ruvalcaba informó a la familia de la víctima que el paciente no aguanto el tratamiento y se golpeó sólo contra la pared. Sin embargo la autopsia reveló que fue asesinado de varios golpes en el tórax provocados por otras personas. Tras una investigación realizada por agentes de la Unidad de Delitos contra la Vida, se encontraron pruebas suficientes contra los ahora detenidos que llevado a que un juez de Garantía otorgara la orden de aprehensión correspondientes las cuales fueron ejecutadas este martes. En las próximas horas serán internados en el Cereso a disposición del juez de Garantía.", backup_file: nil, source: "http://diario.mx/Local/2014-02-11_fad39ced/arrestan-a-director-de-centro-de-rehabilitacion-por-muerte-de-interno", area_id: 10000, crime_id: 1, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.37125968933105", latitude: "31.680081860969107", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE ARRESTAN A DIRECTOR DE CENTRO DE REHABILITACIÓN POR MUERTE DE INTERNO MANUEL GOMEZ MORIN Juárez NORTE HOMICIDIO LA VÍCTIMA FUE AMARRADO Y GOLPEADO HASTA MORIR TRAS SUFRIR UN ATAQUE DE ANSIEDAD POR FALTA DE ALCOHOL EN EL CENTRO DE REHABILITACIÓN ANDAR A0-MEDIOS-NORTE ARRESTAN A DIRECTOR DE CENTRO DE REHABILITACIÓN POR MUERTE DE INTERNO MANUEL GOMEZ MORIN Juárez NORTE HOMICIDIO LA VÍCTIMA FUE AMARRADO Y GOLPEADO HASTA MORIR TRAS SUFRIR UN ATAQUE DE ANSIEDAD POR FALTA DE ALCOHOL EN EL CENTRO DE REHABILITACIÓN ANDAR A036 ARRESTAN A DIRECTOR DE CENTRO DE REHABILITACIÓN POR MUERTE DE INTERNO MANUEL GOMEZ MORIN Juárez NORTE HOMICIDIO LA VÍCTIMA FUE AMARRADO Y GOLPEADO HASTA MORIR TRAS SUFRIR UN ATAQUE DE ANSIEDAD POR FALTA DE ALCOHOL EN EL CENTRO DE REHABILITACIÓN ANDAR", raw_rnum_: 255},
