N LA CAMIONETA PARA INSPECCIÓN DE RUTINA, LA MUJER TRATO DE EVADIR A LOS OFICIALES, POR LO QUE  LOS AGENTES LE CERRARON EL PASO CON LAS UNIDADES Y SOMETIERON EL VEHÍCULO A REVISIÓN, ENE EL INTERIOR LA MUJER TRANSPORTABA 628 PAQUETES CON MARIHUANA", raw_rnum_: 260},
  {priority_id: 10000, event_date: "2014-02-19 05:14:00", description: "EJECUTAN  A MUJER EN VIADUCTO .\r\n\r\nUna mujer fue ejecutada de 18 balazos a un costado del viaducto Gustavo Díaz Ordaz en la colonia Aldama la noche del martes.\r\nEl crimen se reportó alrededor de las 9:30 de la noche a la altura de la calle Mauricio Corredor.\r\nLa víctima fue atacada por los agresores frente a las instalaciones de un yonke abandonado. Su cuerpo quedó tirado en uno de los accesos al viaducto.\r\nVecinos del lugar señalaron desconocer a la mujer asesinada, pero indicaron haber escuchado muchas detonaciones.\r\nTambién vieron una pick up color negra en la cual viajaban los asesinos y de la cual algunos aseguraron que bajaron a la víctima.\r\nAl lugar acudieron elementos de la Secretaria de Seguridad Pública municipal encabezados por el secretario César Muñoz quienes únicamente acordonaron el área del crimen y después se retiraron.\r\nTambién acudió personal de la Fiscalía General del Estado quienes ordenaron el cuerpo al Servicio Médico Forense. No se realizó ni un operativo para dar con los asesinos.\r\n", address: "VIADUCTO DIAZ ORDAZ Y MAURICIO CORREDOR ", suburb: "COL. ALDAMA ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Una mujer fue ejecutada de 18 balazos a un costado del viaducto Gustavo Díaz Ordaz en la colonia Aldama la noche del martes.\r\nEl crimen se reportó alrededor de las 9:30 de la noche a la altura de la calle Mauricio Corredor.\r\nLa víctima fue atacada por los agresores frente a las instalaciones de un yonke abandonado. Su cuerpo quedó tirado en uno de los accesos al viaducto.\r\nVecinos del lugar señalaron desconocer a la mujer asesinada, pero indicaron haber escuchado muchas detonaciones.\r\nTambién vieron una pick up color negra en la cual viajaban los asesinos y de la cual algunos aseguraron que bajaron a la víctima.\r\nAl lugar acudieron elementos de la Secretaria de Seguridad Pública municipal encabezados por el secretario César Muñoz quienes únicamente acordonaron el área del crimen y después se retiraron.\r\nTambién acudió personal de la Fiscalía General del Estado quienes ordenaron el cuerpo al Servicio Médico Forense. No se realizó ni un operativo para dar con los asesinos.\r\n", backup_file: nil, source: "http://puentelibre.mx/_notas/1561580", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.49604812264442", latitude: "31.735504279833897", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS EJECUTAN  A MUJER EN VIADUCTO . VIADUCTO DIAZ ORDAZ Y MAURICIO CORREDOR  NORTE HOMICIDIO  A0-MEDIOS EJECUTAN  A MUJER EN VIADUCTO . VIADUCTO DIAZ ORDAZ Y MAURICIO CORREDOR  NORTE HOMICIDIO  A036 EJECUTAN  A MUJER EN VIADUCTO . VIADUCTO DIAZ ORDAZ Y MAURICIO CORREDOR  NORTE HOMICIDIO  A036 EJECUTAN  A MUJER EN VIADUCTO .\r\n\r\nUna mujer fue ejecutada de 18 balazos a un costado del viaducto Gustavo Díaz Ordaz en la colonia Aldama la noche del martes.\r\nEl crimen se reportó alrededor de las 9:30 de la noche a la altura de la calle Mauricio Corredor.\r\nLa víctima fue atacada por los agresores frente a las instalaciones de un yonke abandonado. Su cuerpo quedó tirado en uno de los accesos al viaducto.\r\nVecinos del lugar señalaron desconocer a la mujer asesinada, pero indicaron haber escuchado muchas detonaciones.\r\nTambién vieron una pick up color negra en la cual viajaban los asesinos y de la cual algunos aseguraron que bajaron a la víctima.\r\nAl lugar acudieron elementos de la Secretaria de Seguridad Pública municipal encabezados por el secretario César Muñoz quienes únicamente acordonaron el área del crimen y después se retiraron.\r\nTambién acudió personal de la Fiscalía General del Estado quienes ordenaron el cuerpo al Servicio Médico Forense. No se realizó ni un operativo para dar con los asesinos.\r\n VIADUCTO DIAZ ORDAZ Y MAURICIO CORREDOR  NORTE HOMICIDIO Una mujer fue ejecutada de 18 balazos a un costado del viaducto Gustavo Díaz Ordaz en la colonia Aldama la noche del martes.\r\nEl crimen se reportó alrededor de las 9:30 de la noche a la altura de la calle Mauricio Corredor.\r\nLa víctima fue atacada por los agresores frente a las instalaciones de un yonke abandonado. Su cuerpo quedó tirado en uno de los accesos al viaducto.\r\nVecinos del lugar señalaron desconocer a la mujer asesinada, pero indicaron haber escuchado muchas detonaciones.\r\nTambién vieron una pick up color negra en la cual viajaban los asesinos y de la cual algunos aseguraron que bajaron a la víctima.\r\nAl lugar acudieron elementos de la Secretaria de Seguridad Pública municipal encabezados por el secretario César Muñoz quienes únicamente acordonaron el área del crimen y después se retiraron.\r\nTambién acudió personal de la Fiscalía General del Estado quienes ordenaron el cuerpo al Servicio Médico Forense. No se realizó ni un operativo para dar con los asesinos.\r\n", raw_rnum_: 261},
  {priority_id: 10001, event_date: "2014-02-07 18:41:25", description: "ASESINADO AQUÍ ERA BUSCADO POR LA DEA", address: "HERMANOS ESCOBAR Y URUGUAY", suburb: "PARTIDO ROMERO", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "LA VÍCTIMA SE ENCONTRABA A BORDO DE UN CARRO MARCA BMW, LÍNEA 323I COLOR AZUL MARINO, EL CADÁVER DEL TRIPULANTE QUEDÓ CON IMPACTO DE BALA EN VARIAS PARTES DEL CUERPO\r\n\r\nMiguel Ángel Agüero Miranda, quien fue asesinado a balazos el jueves pasado en Ciudad Juárez, al parecer era buscado en Estados Unidos por la DEA (Drug Enforcement Administration), en el área de St. Louis, acusado de conspiración para distribuir metanfetamina. La Fiscalía General del Estado informó que Agüero Miranda tenía 52 años de edad. El asesinato de Miguel Ángel Agüero ocurrió la tarde del jueves, en un negocio de carrocería y desponchado que se ubica en el cruce de las calles Hermanos Escobar y Uruguay, en la colonia Partido Romero, en Ciudad Juárez. La víctima se encontraba a bordo de un carro marca BMW, línea 323I, color azul marino. El cadáver de Agüero Miranda quedó con impactos de bala en varias partes del cuerpo. Al lugar del crimen llegaron policías de las diferentes corporaciones, pero fue el personal de la Fiscalía Zona Norte quien se encargó del caso. Posteriormente la autoridad logró identificar el cadáver y, de acuerdo con información que aparece, Agüero Miranda era buscado por la DEA y se ofrecía una recompensa por su captura.", backup_file: nil, source: "http://diario.mx/Local/2014-02-07_9caad245/asesinado-aqui-era-buscado-por-la-dea/", area_id: 10000, crime_id: 1, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.4708662033081", latitude: "31.74117911010148", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE ASESINADO AQUÍ ERA BUSCADO POR LA DEA HERMANOS ESCOBA