  {priority_id: 10001, event_date: "2014-02-13 18:16:15", description: "A SALVO DE UN TIROTEO\r\n\r\nUna familia fue tiroteada durante la noche y aunque no fueron impactados por las balas, la madre de dos niñas resultó lesionada luego de que su esposo perdió el control del automóvil y chocó contra un poste en colonia Hacienda de las Torres., Los afectados circulaban a bordo de un Ford LTD Crown Victoria por la calle José Moreno Baca, y fue poco ante del cruce con Yepómera cuando surgieron los disparos, al parecer realizados por dos hombres.\r\nEl auto se detuvo al colisionar contra la columna de concreto del medidor de luz de la iglesia Al Pie de la Cruz.\r\nGabriela Mora Barrera, de 29 años de edad, resultó lesionada en pierna derecha y pie izquierdo , mientras que sus dos hijas y marido salieron ilesos.\r\nEn el lugar fueron ubicados ocho casquillos, al parecer de arma corta.", address: "JOSE MORENO BACA Y YEPOMERA", suburb: "HACIENDA DE LAS TORRES", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "UNA FAMILIA FUE TIROTEADA DURANTE LA NOCHE Y AUNQUE NO FUERON IMPACTADOS POR LAS BALAS, LA MADRE DE DOS NIÑAS RESULTÓ LESIONADA", backup_file: nil, source: "http://www.lapoliciaca.com/nota-roja/a-salvo-de-un-tiroteo-choca-una-familia-en-hacienda-de-las-torres/", area_id: 10000, crime_id: 2, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.40728712081909", latitude: "31.613955890989477", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE A SALVO DE UN TIROTEO JOSE MORENO BACA Y YEPOMERA Juárez NORTE LESIONES UNA FAMILIA FUE TIROTEADA DURANTE LA NOCHE Y AUNQUE NO FUERON IMPACTADOS POR LAS BALAS, LA MADRE DE DOS NIÑAS RESULTÓ LESIONADA A0-MEDIOS-NORTE A SALVO DE UN TIROTEO JOSE MORENO BACA Y YEPOMERA Juárez NORTE LESIONES UNA FAMILIA FUE TIROTEADA DURANTE LA NOCHE Y AUNQUE NO FUER