  {priority_id: 10001, event_date: "2014-02-24 15:43:56", description: "ARRESTAN A DOS 'CARJACKERS' QUE DESPOJARON A MUJER DE JEEP DE LUJO\r\nELEMENTOS DE LA POLICíA MUNICIPAL DETUVIERON ESTE LUNES TRAS INTERVENCIóN REALIZADA EN PARAJES DEL VALLE A DOS 'CARJACKERS' QUE DESPOJARON A MUJER DE JEEP DE LUJO EN LA COLONIA SALVáRCAR\r\n\r\nDos 'carjackers' quedaron bajo arresto por elementos de la Policía Municipal cuando realizaban patrullaje de seguridad por calles de la colonia Parajes del Valle.\r\n\r\nEste lunes, la Secretaría de Seguridad Pública Municipal (SSPM) reportó que alrededor de las 16:00 horas de hoy, agentes de la corporación que recorrían la colonia Parajes del Valle ubicaron camioneta Jeep Commander, modelo 2006, la cual contaba con las características de unidad robada minutos antes.\r\n\r\nLos agentes le marcaron el alto a la camioneta y en el cruce de Fortín de la Soledad y calle 1310, la unidad detuvo su marcha. Del vehículo descendieron dos hombres con armas de fuego y apuntaron directo a los elementos de la Policía Municipal.\r\n\r\nDe igual forma, los agentes tomaron su arma de cargo y apuntaron a los sospechosos, quienes finalmente se tiraron al suelo y arrojaron sus armas, informó la SSPM.\r\n\r\nEstos jóvenes se identificaron como Miguel Adrián Buenrostro de 23 años y Víctor Armando Mora de 21 años, quienes quedaron bajo arresto.\r\n\r\nLa SSPM informó que tras investigar a estas personas se descubrió que minutos antes de la detención, con uso de las armas de fuego despojaron a mujer de la camioneta en la colonia Salvárcar, además de robar televisión de LCD de 32 pulgadas, estéreo par auto y par de botas de la vivienda de la víctima.\r\n\r\nAl momento de su arresto, los agentes aseguraron la camioneta y artículos robados, así como dos armas de fuego tipo escuadra calibre .45 y .25 milímetros con dos cartuchos útiles.\r\n\r\nPosteriormente, estas personas quedarán a disposición de la autoridad correspondiente por el delito de robo con lujo de violencia.\r\n\r\n", address: nil, suburb: "Parajes del Valle ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "DOS 'CARJACKERS' QUEDARON BAJO ARRESTO POR ELEMENTOS DE LA POLICíA MUNICIPAL CUANDO REALIZABAN PATRULLAJE DE SEGURIDAD POR CALLES DE LA COLONIA PARAJES DEL VALLE.\r\n\r\nESTE LUNES, LA SECRETARíA DE SEGURIDAD PúBLICA MUNICIPAL (SSPM) REPORTó QUE ALREDEDOR DE LAS 16:00 HORAS DE HOY, AGENTES DE LA CORPORACIóN QUE RECORRíAN LA COLONIA PARAJES DEL VALLE UBICARON CAMIONETA JEEP COMMANDER, MODELO 2006, LA CUAL CONTABA CON LAS CARACTERíSTICAS DE UNIDAD ROBADA MINUTOS ANTES.\r\n\r\nLOS AGENTES LE MARCARON EL ALTO A LA CAMIONETA Y EN EL CRUCE DE FORTíN DE LA SOLEDAD Y CALLE 1310, LA UNIDAD DETUVO SU MARCHA. DEL VEHíCULO DESCENDIERON DOS HOMBRES CON ARMAS DE FUEGO Y APUNTARON DIRECTO A LOS ELEMENTOS DE LA POLICíA MUNICIPAL.\r\n\r\nDE IGUAL FORMA, LOS AGENTES TOMARON SU ARMA DE CARGO Y APUNTARON A LOS SOSPECHOSOS, QUIENES FINALMENTE SE TIRARON AL SUELO Y ARROJARON SUS ARMAS\r\n\r\n\r\nDos 'carjackers' quedaron bajo arresto por elementos de la Policía Municipal cuando realizaban patrullaje de seguridad por calles de la colonia Parajes del Valle.\r\n\r\nEste lunes, la Secretaría de Seguridad Pública Municipal (SSPM) reportó que alrededor de las 16:00 horas de hoy, agentes de la corporación que recorrían la colonia Parajes del Valle ubicaron camioneta Jeep Commander, modelo 2006, la cual contaba con las características de unidad robada minutos antes.\r\n\r\nLos agentes le marcaron el alto a la camioneta y en el cruce de Fortín de la Soledad y calle 1310, la unidad detuvo su marcha. Del vehículo descendieron dos hombres con armas de fuego y apuntaron directo a los elementos de la Policía Municipal.\r\n\r\nDe igual forma, los agentes tomaron su arma de cargo y apuntaron a los sospechosos, quienes finalmente se tiraron al suelo y arrojaron sus armas, informó la SSPM.\r\n\r\nEstos jóvenes se identificaron como Miguel Adrián Buenrostro de 23 años y Víctor Armando Mora de 21 años, quienes quedaron bajo arresto.\r\n\r\nLa SSPM informó que tras investigar a estas personas se descubrió que minutos antes de la detención, con uso de las armas de fuego despojaron a mujer de la camioneta en la colonia Salvárcar, además de robar televisión de LCD de 32 pulgadas, estéreo par auto y par de botas de la vivienda de la víctima.\r\n\r\nAl momento de su arresto, los agentes aseguraron la camioneta y artículos robados, así como dos armas de fuego tipo escuadra calibre .45 y .25 milímetros con dos cartuchos útiles.\r\n\r\nPosteriormente, estas personas quedarán a disposición de la autoridad correspondiente por el delito de robo con lujo de violencia.\r\n\r\n", backup_file: nil, source: "http://puentelibre.mx/_notas/1567890", area_id: 10000, crime_id: 39, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.38844728469849", latitude: "31.615490838733052", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE ARRESTAN A DOS 'CARJACKERS' QUE DESPOJARON A MUJER DE JEEP DE LUJO\r\nELEMENTOS DE LA POLICíA MUNICIPAL DETUVIERON ESTE LUNES TRAS INTERVENCIóN REALIZADA EN PARAJES DEL VALLE A DOS 'CARJACKERS' QUE DESPOJARON A MUJER DE JEEP DE LUJO EN LA COLONIA SALVáRCAR\r\n  Juárez NORTE ROBO DE VEHICULO DOS 'CARJACKERS' QUEDARON BAJO ARRESTO POR ELEMENTOS DE LA POLICíA MUNICIPAL CUANDO REALIZABAN PATRULLAJE DE SEGURIDAD POR CALLES DE LA COLONIA PARAJES DEL VALLE.\r\n\r\nESTE LUNES, LA SECRETARíA DE SEGURIDAD PúBLICA MUNICIPAL (SSPM) REPORTó QUE ALREDEDOR DE LAS 16:00 HORAS DE HOY, AGENTES DE LA CORPORACIóN QUE RECORRíAN LA COLONIA PARAJES DEL VALLE UBICARON CAMIONETA JEEP COMMANDER, MODELO 2006, LA CUAL CONTABA CON LAS CARACTERíSTICAS DE UNIDAD ROBADA MINUTOS ANTES.\r\n\r\nLOS AGENTES LE MARCARON EL ALTO A LA CAMIONETA Y EN EL CRUCE DE FORTíN DE LA SOLEDAD Y CALLE 1310, LA UNID