  {priority_id: 10001, event_date: "2014-02-20 15:40:38", description: "ACRIBILLAN A DOS EN PARAJES DEL SUR; TERCER ATAQUE ARMADO EN 3 HORAS\r\nESTA NOCHE SICARIOS EJECUTARON A BALAZOS A PERSONA EN PARAJES DEL SUR E HIRIERON A OTRA EN EL INTERIOR DE PUESTO DE SEGUNDAS, EN EL TERCER HECHO VIOLENTO DE ESTA TARDE EN LA CIUDAD\r\n", address: nil, suburb: "PARAJES DEL SUR", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "La nota periodistica, hace mencion a dos personas ejecutadas, sin embargo en el reporte (066) y carpeta de investigacion se confirma que se trata de solo de un lesionado", backup_file: nil, source: "http://puentelibre.mx/_notas/1563711", area_id: 10000, crime_id: 1, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 3, status_id: 10023, longitude: "-105.966667", latitude: "28.700001", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE ACRIBILLAN A DOS EN PARAJES DEL SUR; TERCER ATAQUE ARMADO EN 3 HORAS\r\nESTA NOCHE SICARIOS EJECUTARON A BALAZOS A PERSONA EN PARAJES DEL SUR E HIRIERON A OTRA EN EL INTERIOR DE PUESTO DE SEGUNDAS, EN EL TERCER HECHO VIOLENTO DE ESTA TARDE EN LA CIUDAD\r\n  Juárez NORTE HOMICIDIO EL LUGAR DONDE OCURRIó EL ATAQUE QUEDA SOBRE LA CALLE PASEO DE SUR, QUE ES EL ACCESO PRINCIPAL A LA COLONIA, MUY CERCA DE LA CALLE MAR DEL AZUL, DONDE SE UBICA ALGUNA TIENDA DEL RíO Y LA ESCUELA DE LA COLONIA.\r\n\r\nHASTA EL MOMENTO SE DESCONOCE LA IDENTIDAD DE LA PERSONA QUE QUEDó SIN VIDA, EN TANTO QUE EL ESTADO DE SALUD DEL SUJETO HERIDO SE REPORTA COMO CRíTICO, PUES AL PARECER RECIBIó ALGúN IMPACTO DE BALA EN LA CABEZA.\r\n\r\nPOR TAL MOTIVO LO TRASLADARON AL HOSPITAL MáS CERCANO PARA QUE RECIBIERA ATENCIóN MéDICA\r\n A0-MEDIOS-NORTE ACRIBILLAN A DOS EN PARAJES DEL SUR; TERCER ATAQUE ARMADO EN 3 HORAS\r\nESTA NOCHE SICARIOS EJECUTARON A BALAZOS A PERSONA EN PARAJES DEL SUR E HIRIERON A OTRA