  {priority_id: 10000, event_date: "2014-02-28 03:44:45", description: "BALEAN A  MUJER \r\nUna mujer fue asesinada a balazos esta noche en la colonia Obrera.\r\n\r\n Los hechos se registraron alrededor de las 9 de la noche en las calles Pablo López Sidar e Ignacio Alatorre.\r\n\r\n De acuerdo con datos preliminares, la víctima fue bajada de un vehículo por hombres armados que después le dispararon al menos en cuatro ocasiones en el rostro y la cabeza.\r\n\r\n Después huyeron rechinando las llantas,  señaló un habitante del sector que salió de su domicilio para ver lo que ocurría.\r\n\r\n La mujer es de entre 25 y 26 años, vestía un pantalón de mezclilla color azul, guaraches de pata de gallo rosas, blusa del mismo color, así como una chamarra de mezclilla.\r\n\r\n La asesinada no fue reconocida por habitantes del sector.\r\n\r\n Al lugar acudieron elementos de la Policía Municipal quienes acordonaron el área e iniciaron un operativo en busca de los responsables.\r\n\r\n También agentes de la Fiscalía General del Estado quienes iniciaron las investigaciones y ordenaron el traslado del cuerpo al Servicio Médico Forenses (Semefo).\r\n\r\n En la zona, es el segundo homicidio que se presenta con las mismas característica. La semana antepasada otra mujer fue bajada de un vehículo sobre el viaducto Gustavo Díaz Ordaz y asesinada a balazos.\r\n", address: "PABLO SIDAR E IGNACIO ALATORRE", suburb: "OBRERA", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Una mujer fue asesinada a balazos esta noche en la colonia Obrera.\r\n\r\n Los hechos se registraron alrededor de las 9 de la noche en las calles Pablo López Sidar e Ignacio Alatorre.\r\n\r\n De acuerdo con datos preliminares, la víctima fue bajada de un vehículo por hombres armados que después le dispararon al menos en cuatro ocasiones en el rostro y la cabeza.\r\n\r\n Después huyeron rechinando