  {priority_id: 10001, event_date: "2014-02-23 16:11:43", description: "ACRIBILLAN A CHOFER DEL TRANSPORTE PúBLICO EN COLONIA FELIPE ÁNGELES", address: "TABACO Y TAYOLITA", suburb: "FELIPE ÁNGELES", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "UN CHOFER DEL TRANSPORTE PúBLICO FUE BALEADO POR TRES SUJETOS EN LA COLONIA FELIPE ÁNGELES.\r\nEL INTENTO DE EJECUCIóN OCURRIó EN LAS INMEDIACIONES DE LAS CALLES MAPLE Y SOMBRERETE, CUANDO TRES HOMBRES SE APROXIMARON AL CAMIóN DE LA RUTA ORIENTE PONIENTE 2329 Y LE DISPARARON A LA VíCTIMA\r\nUn chofer del transporte Público, fue tiroteado por varios hombres, durante la tarde del domingo en calles de la colonia Felipe Angeles.\r\nVecinos del cruce de calles Maple y Sombrerete afirmaron que en el ataque participaron tres individuos, de características no conocidas.\r\nSeñalaron que el lesionado conducía un autobús de número económico 2329 de la ruta Oriente-poniente.\r\nEl lesionado, de identidad por establecer, fue movilizado a bordo de un auto particular a instalaciones del Hospital de la Familia.", backup_file: nil, source: "http://lapolaka.com/ruteras-story/", area_id: 10000, crime_id: 2, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.5272569656372", latitude: "31.7642968420405", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE ACRIBILLAN A CHOFER DEL TRANSPORTE PúBLICO EN COLONIA FELIPE ÁNGELES TABACO Y TAYOLITA Juárez NORTE LESIONES UN CHOFER DEL TRANSPORTE PúBLICO FUE BALEADO POR TRES SUJETOS EN LA COLONIA FELIPE ÁNGELES.\r\nEL INTENTO DE EJECUCIóN OCURRIó EN LAS INMEDIACIONES DE LAS CALLES MAPLE Y SOMBRERETE, CUANDO TRES HOMBRES SE APROXIMARON AL CAMIóN DE LA RUTA ORIENTE PONIENTE 2329 Y LE DISPARARON A LA VíCTIMA\r\n A0-MEDIOS-NORTE ACRIBILLAN A CHOFER DEL TRANSPORTE PúBLICO EN COLONIA FELIPE ÁNGELES TABACO Y TAYOLITA Ju