  {priority_id: 10001, event_date: "2014-02-16 16:25:27", description: "EJECUTAN A HOMBRE EN  PATIO DE VIVIENDA LOMA BLANCA.\r\nDe acuerdo con primeras versiones, el hombre se encontraba en el patio de domicilio que se ubica sobre la calle prolongación Puerto de Palos cuando fue víctima de ataque con arma de fuego. Al lugar arribaron elementos de la Fiscalía del Estado y de la Policía Municipal para asegurar el área y permitir a los agentes de la Unidad Especializada en Escena del Crimen realizar las investigaciones correspondientes. La víctima fue identificada de manera extraoficial como Víctor Manuel Jiménez Velázquez de 33 años de edad. Personal del Servicio Médico Forense retiró el cuerpo de la escena del crimen para trasladarlo a sus laboratorios para los análisis de ley.", address: "PUERTO DE PALOS", suburb: "LOMA BLANCA", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "AL LUGAR LLEGARON DESCONOCIDOS E INGRESARON AL PATIO, DONDE SE ENCONTRABA LA VÍCTIMA  AL QUE LE DISPARARON CON ARMA DE FUEGO", backup_file: nil, source: "http://puentelibre.mx/_notas/1559210", area_id: 10000, crime_id: 1, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.29847526550293", latitude: "31.580875273985466", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE EJECUTAN A HOMBRE EN  PATIO DE VIVIENDA LOMA BLANCA PUERTO DE PALOS Juárez NORTE HOMICIDIO AL LUGAR LLEGARON DESCONOCIDOS E INGRESARON AL PATIO, DONDE SE ENCONTRABA LA VÍCTIMA  AL QUE LE DISPARARON CON ARMA DE FUEGO A0-MEDIOS-NORTE EJECUTAN A HOMBRE EN  PATIO DE VIVIENDA LOMA BLANCA PUERTO DE PALOS Juárez NORTE HOMICIDIO AL LUGAR LLEGARON DESCONOCIDOS E INGRESARON AL PATIO, DONDE SE ENCONTRABA LA VÍCTIMA  AL QUE LE DISPARARON CON ARMA DE FUEGO A036 EJECUTAN A HOMBRE EN  PATIO DE VIVIENDA LOMA BLANCA PUERTO DE PALOS Juárez NORTE HOMICIDIO AL LUGAR LLEGARON DESCONOCIDOS E INGRESARON AL PATIO, DONDE SE ENCONTRABA LA VÍCTIMA  AL QUE LE DISPARARON CON ARMA DE FUEGO", raw_rnum_: 288},
  {priority_id: 10001, event_date: "2014-02-24 21:53:24", description: "DETIENEN A MINISTERIAL Y  GUARDIAS DE SEGURIDAD POR ROBO DE ARMAS. \r\nUn juez de garantía dictó prisión preventiva a un agente ministerial y tres guardias de la Fiscalía General del Estado (FGE) Zona Norte, acusados del delito de robo agravado y asociación delictuosa.\r\n\r\nLos imputados son el oficial Rafael Castillo Gutiérrez, de 44 años; el jefe de guardias de seguridad Jesús Ángel Méndez Padilla, de 23; Lorenzo Antonio Hinojosa Ibarra, de 31, y Manuel Uriel Moreno Ramírez, de 29.\r\n\r\nEn base a las pruebas expuestas por el agente del Ministerio Público, a los cuatros detenidos se les acusa del robo de diversas armas de fuego, celulares, aparatos de computación y carpetas de investigación pertenecientes a la Fiscalía.\r\n\r\nDe acuerdo a la causa penal 417/14, el monto de lo robado asciende a 165 mil pesos, pudiendo alcanzar una condena máxima de 42 años de prisión.\r\n\r\nEl juez fijó el 27 de este mes como fecha para celebrar la audiencia de vinculación o no a proceso.\r\n", address: nil, suburb: nil, locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Un juez de garantía dictó prisión preventiva a un agente ministerial y tres guardias de la Fiscalía General del Estado (FGE) Zona Norte, acusados del delito de robo agravado y asociación delictuosa.\r\n\r\nLos imputados son el oficial Rafael Castillo Gutiérrez, de 44 años; el jefe de guardias de seguridad Jesús Ángel Méndez Padilla, de 23; Lorenzo Antonio Hinojosa Ibarra, de 31, y Manuel Uriel Moreno Ramírez, de 29.\r\n\r\nEn base a las pruebas expuestas por el agente del Ministerio Público, a los cuatros detenidos se les acusa del robo de diversas armas de fuego, celulares, aparatos de computación y carpetas de investigación pertenecientes a la Fiscalía.\r\n\r\nDe acuerdo a la causa penal 417/14, el monto de lo robado asciende a 165 mil pesos, pudiendo alcanzar una condena máxima de 42 años de prisión.\r\n\r\nEl juez fijó el 27 de este mes como fecha para celebrar la audiencia de vinculación o no a proceso.\r\n", backup_file: nil, source: "http://puentelibre.mx/_notas/1567430", area_id: 10000, crime_id: 37, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-105.966667", latitude: "28.700001", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS DETIENEN A MINISTERIAL Y  GUARDIAS DE SEGURIDAD POR ROBO DE ARMAS.   NORTE ROBO  A0-MEDIOS DETIENEN A MINISTERIAL Y  GUARDIAS DE SEGURIDAD POR ROBO DE ARMAS.  NORTE ROBO  A036 DETIENEN A MINISTERIAL Y  GUARDIAS DE SEGURIDAD POR ROBO DE ARMAS.  NORTE ROBO ", raw_rnum_: 289},
