  {priority_id: 10001, event_date: "2014-02-27 20:28:09", description: "CAEN DOS CON ARSENAL EN LA COLONIA HIDALGO", address: "REPúBLICA DEL SALVADOR Y PEDRO S. VARELA ", suburb: "HIDALGO", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "LA POLICIA MUNICIPAL DETIVO A DOS SUPUESTOS INTEGRANTES DE LOS ‘AZTECAS’ CON UN ARSENAL EN LA COLONIA HIDALGO ESTA MADRUGADA.\r\n\r\nDE ACUERDO CON EL PARTE INFORMATIVO DE LA POLICíA MUNICIPAL, LA DETENCIóN SE REGISTRó A LAS 01:30 HORAS EN LAS CALLES REPúBLICA DEL SALVADOR Y PEDRO S. VARELA DE LA COLONIA EN MENCIóN.\r\n\r\nLAS UNIDADES POLICIACAS HACíAN UN RECORRIDO DE VIGILANCIA POR DICHAS CALLES CUANDO DETECTARON A UN HOMBRE CON UN ARMA DE FUEGO EN LA MANO, MISMA QUE UTILIZó PARA APUNTARLES.\r\n\r\nLOS AGENTES ALCANZARON A VER QUE EL SUJETO SE METIó A UNA COCHERA DE UNA CASA, POR LO QUE RáPIDO PIDIERON APOYO A MáS PATRULLAS, PARA ACORRALARLO.\r\n\r\nEN EL DOMICILIO DETUVIERON AL HOMBRE QUE INGRESó AL LUGAR Y A OTRO MáS QUE CUIDABA EL ARSENAL QUE ESTABA EN LA VIVIENDA.\r\n\r\nLOS DETENIDOS FUERON IDENTIFICADOS COMO JAIME ALBERTO CARBAJAL DíAZ DE 28 AñOS Y VíCTOR HUGO ELIZONDO PéREZ DE 34\r\nEL ARSENAL QUE TENíAN EN SU PODER SON TRES FUSILES DE ASALTO A-K 47 CON SUS CARGADORES ABASTECIDOS CON 22 CARTUCHOS CADA UNO, UN RIFLE CALIBRE .22 Y UNA PISTOLA .38 ESPECIAL.\r\n\r\nTAMBIéN LES ASEGURARON 130 CARTUCHOS CALIBRE 7.62 X 39 Y 200 DE CALIBRE .223, ASI COMO 2 CARGADORES PARA UN ARMA TIPO UZI, UNO DE ELLOS ABASTECIDO.\r\n\r\nAL IGUAL SE LES DECOMISARON UNA GRANADA DE HUMO, TRES CHALECOS ANTIBALAS, DOS PLACAS Y 43 DOSIS DE MARIGUANA.\r\nLOS DETENIDOS INFORMARON A LA POLICIA QUE PERTENECIAN AL GRUPO DE LOS ‘AZTECAS’\r\n\r\n", backup_file: nil, source: "http://diario.mx/Local/2014-02-27_6c10bb08/caen-dos-con-arsenal-en-la-colonia-hidalgo/", area_id: 10000, crime_id: 120, township_id: 38, locality_id: 7391, plac