  {priority_id: 10001, event_date: "2014-02-26 20:38:00", description: "ARRESTAN A PRIMO DE \"EL MARRUFO\" CON DROGA EN EL PAPALOTE\r\n\r\nAGENTES DE LA POLICíA ÚNICA DETUVIERON ESTA MADRUGADA MIENTRAS TRANSPORTABA DROGA EN LA COLONIA EL PAPALOTE, AL PRIMO DE \"EL MARRUFO\" LíDER DE GRUPO CRIMINAL QUE ARRESTó LA POLICIA FEDERAL.\r\n\r\nUn hombre fue interceptado cuando circulaba a exceso de velocidad y llevaba 15 kilogramos de mariguana distribuidos en 31 paquetes de plástico y un costal, informó la Policía Estatal Única División Preventiva. Se trata de Mario Marrufo Fernández de 49 años, quien fue detenido la madrugada de este día en el cruce de bulevar Independencia y calle Juan Escutia de la colonia El Papalote. “Agentes que circulaban por dichas calles, se percataron de un vehículo tipo pick up, de la marca Ford, línea F350, modelo 1991, de color gris, con matrículas de circulación DZ55734 del estado de Chihuahua, que circulaba a exceso de velocidad, por lo que se le hizo el alto”, dio a conocer. Se le sometió a revisión y en el vehículo en la parte trasera del piloto se localizaron 31 paquetes de plástico transparente con una hierba verde con características de mariguana y un peso aproximado de 12.5 kilogramos, continuó. También llevaba un costal blanco con la misma hierba, con un peso aproximado de 2.5 kilogramos, por lo que en ese momento quedó bajo arresto y se le aseguraron el enervante y el automotor, añadió.", address: "JUAN ESCUTIA Y LIBRAMIENTO AEROPUERTO", suburb: "EL PAPALOTE", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "SE TRATA DE MARIO MARRUFO FERNáNDEZ DE 49 AñOS DE EDAD, QUIEN CONDUCíA LA CAMIONETA FORD F350 COLOR GRIS, MODELO 1991 A EXCESO DE VELOCIDAD POR LO QUE LE MARCARON EL ALTO EN LA CALLE JUAN ESCUTIA Y LIBRAMIENTO AEROPUERTO.\r\n\r\nAL REVISAR LA CAMIONETA EN LA PARTE TRASERA DEL PILOTO SE LOCALIZARON 31 PAQUETES ENVUELTOS EN PAPEL DE PLáSTICO TRANSPARENTE QUE CONTENíAN MARIHUANA, CON PESO DE 12.5 KILOGRAMOS.\r\n\r\nADEMáS COSTAL DE COLOR BLANCO QUE EN SU INTERIOR TAMBIéN CONTENíA MARIHUANA, CON PESO DE 2.5 KILOGRAMOS, EN ESE MOMENTO MARRUFO FERNáNDEZ QUEDO BAJO ARRESTO, SE ASEGURó EL ENERVANTE Y DICHO AUTOMOTOR.\r\n\r\nPOR LO ANTERIOR SE LE ARRESTó Y TRASLADó A LAS INSTALACIONES DE LA POLICíA ESTATAL ÚNICA PARA SU POSTERIOR CONSIGNACIóN ANTE EL AGENTE DEL MINISTERIO PúBLICO DE LA FEDERACIóN\r\n", backup_file: nil, source: "http://puentelibre.mx/_notas/1569660", area_id: 10000, crime_id: 130, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.4190673828125", latitude: "31.658057274089913", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE ARRESTAN A PRIMO DE \"EL MARRUFO\" CON DROGA EN EL PAPALOTE\r\n\r\nAGENTES DE LA POLICíA ÚNICA DETUVIERON ESTA MADRUGADA MIENTRAS TRANSPORTABA DROGA EN LA COLONIA EL PAPALOTE, AL PRIMO DE \"EL MARRUFO\" LíDER DE GRUPO CRIMINAL QUE ARRESTó LA POLICIA FEDERAL. JUAN ESCUTIA Y LIBRAMIENTO AEROPUERTO Juárez NORTE CONTRA LA SALUD SE TRATA DE MARIO MARRUFO FERNáNDEZ DE 49 AñOS DE EDAD, QUIEN CONDUCíA LA CAMIONETA FORD F350 COLOR GRIS, MODELO 1991 A EXCESO DE VELOCIDAD POR LO QUE LE MARCARON EL ALTO EN LA CALLE JUAN ESCUTIA Y LIBRAMIENTO AEROPUERTO.\r\n\r\nAL REVISAR LA CAMIONETA EN LA PARTE TRASERA DEL PILOTO SE LOCALIZARON 31 PAQUETES ENVUELTOS EN PAPEL DE PLáSTICO TRANSPARENTE QUE CONTENíAN MARIHUANA, CON PESO DE 12.5 KILOGRAMOS.\r\n\r\nADEMáS COSTAL DE COLOR BLANCO QUE EN SU INTERIOR TAMBIéN CONTENíA MARIHUANA, CON PESO DE 2.5 KILOGRAMOS, EN ESE MOMENTO MARRUFO FERNáNDEZ QUEDO BAJO ARRESTO, SE ASEGURó EL ENERVANTE Y DICHO AUTOMOTOR.\r\n\r\nPOR LO ANTERIOR SE LE ARRESTó Y TRASLADó A LAS INSTALACIONES DE LA POLICíA ESTATAL ÚNICA PARA SU POSTERIOR CONSIGNACIóN ANTE EL AGENTE DEL MINISTERIO PúBLICO DE LA FEDERACIóN\r\n A0-MEDIOS-NORTE ARRESTAN A PRIMO DE \"EL MARRUFO\" CON DRO