  {priority_id: 10001, event_date: "2014-02-26 20:42:57", description: "DETIENEN A SOSPECHOSO DE BALEAR A DOS HOMBRES\r\n\r\nUn hombre sospechoso de haber cometido un ataque que dejo dos lesionados en el interior de un expendio de cilindros de gas de la avenida Santiago Troncoso y calle Humariza, al sur de la ciudad, fue detenido por agentes de la Secretaría de Seguridad Pública municipal. Se trata de Alejandro de Jesús Luna, de 23 años, quien fue arrestado en posesión de dos pistolas, una calibre .9 milímetros y otra .45, reportaron portavoces de la corporación preventiva. La detención se registró momentos después de que abandonó una camioneta van Aerostar, color verde, en la colonia Los Alcaldes, a varias cuadras de donde se cometió el atentado a eso de las 3:30 de la tarde de este martes. El presunto agresor y al parecer una segunda persona que viajaba con él y que logró escapar de la Policía, dispararon toda la carga de las dos pistolas contra sus víctimas. Tras ser arrestado, Luna señaló a los agentes preventivos que recibiría un pago de 500 pesos por matar a una de las personas lesionadas, indicó personal de la Policía municipal. Las víctimas al parecer un empleado y un cliente fueron trasladadas a un hospital para su atención.", address: "SANTIAGO TRONCOSO Y CALLE HUMARIZA", suburb: "LOS ALCALDES", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "UN HOMBRE SOSPECHOSO DE HABER COMETIDO UN ATAQUE QUE DEJO DOS LESIONADOS EN EL INTERIOR DE UN EXPENDIO DE CILINDROS DE GAS DE LA AVENIDA SANTIAGO TRONCOSO Y CALLE HUMARIZA, AL SUR DE LA CIUDAD, FUE DETENIDO POR AGENTES DE LA SECRETARíA DE SEGURIDAD PúBLICA MUNICIPAL.\r\n\r\nSE TRATA DE ALEJANDRO DE JESúS LUNA, DE 23 AñOS, QUIEN FUE ARRESTADO EN POSESIóN DE DOS PISTOLAS, UNA CALIBRE .9 MILíMETROS Y OTRA .45, REPORTARON PORTAVOCES DE LA CORPORACIóN PREVENTIVA.\r\n\r\nLA DETENCIóN SE REGISTRó MOMENTOS DESPUéS DE QUE ABANDONó UNA CAMIONETA VAN AEROSTAR, COLOR VERDE, EN LA COLONIA LOS ALCALDES, A VARIAS CUADRAS DE DONDE SE COMETIó EL ATENTADO A ESO DE LAS 3:30 DE LA TARDE DE ESTE MARTES.\r\n", backup_file: nil, source: "http://diario.mx/Local/2014-02-25_934c2b78/detienen-a-sospechoso-de-balear-a-dos-hombres/", area_id: 10000, crime_id: 1, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.38758897781372", latitude: "31.63500439580803", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE DETIENEN A SOSPECHOSO DE BALEAR A DOS HOMBRES SANTIAGO TRONCOSO Y CALLE HUMARIZA Juárez NORTE HOMICIDIO UN HOMBRE SOSPECHOSO DE HABER COMETIDO UN ATAQUE QUE DEJO DOS LESIONADOS EN EL INTERIOR DE UN EXPENDIO DE CILINDROS DE GAS DE LA AVENIDA SANTIAGO TRONCOSO Y CALLE HUMARIZA, AL SUR DE LA CIUDAD, FUE DETENIDO POR AGENTES DE LA SECRETARíA DE SEGURIDAD PúBLICA MUNICIPAL.\r\n\r\nSE TRATA DE ALEJANDRO DE JESúS LUNA, DE 23 AñOS, QUIEN FUE ARRESTADO EN POSESIóN DE DOS PISTOLAS, UNA CALIBRE .9 MILíMETROS Y OTRA .45, REPORTARON PORTAVOCES DE LA CORPORACIóN PREVENTIVA.\r\n\r\nLA DETENCIóN SE REGISTRó MOMENTOS DESPUéS DE QUE ABANDONó UNA CAMIONETA VAN AEROSTAR, COLOR VERDE, EN LA COLONIA LOS ALCALDES, A VARIAS CUADRAS DE DONDE SE COMETIó EL ATENTADO A ESO DE LAS 3:30 DE LA TARDE DE ESTE MARTES.\r\n A0-MEDIOS-NORTE DETIENEN A SOSPECHOSO DE BALEAR A DOS HOMBRES SANTIAGO TRONCOSO Y CALLE HUMARIZA Juárez NORTE HOMICIDIO UN HOMBRE SOSPECHOSO DE HABER COMETIDO UN ATAQUE QUE DEJO DOS LESIONADOS EN EL INTERIOR DE UN EXPENDIO DE CILINDROS DE GAS DE LA AVENIDA SANTIAGO TRONCOSO Y CALLE HUMARIZA, AL SUR DE LA CIUDAD, FUE DETENIDO POR AGENTES DE LA SECRETARíA DE SEGURIDAD PúBLICA MUNICIPAL.\r\n\r\nSE TRATA DE ALEJANDRO DE JESúS LUNA, DE 23 AñOS, QUIEN FUE ARRESTADO EN POSESIóN DE DOS PISTOLAS, UNA CALIBRE .9 MILíMETROS Y OTRA .45, REPORTARON PORTAVOCES DE LA CORPORACIóN PREVENTIVA.\r\n\r\nLA DETENCIóN SE REGISTRó MOMENTOS DESPUéS DE