  {priority_id: 10000, event_date: "2014-03-03 18:10:08", description: "ENCUENTRAN PERSONA SIN VIDA. El hallazgo del cadáver se realizó antes de las diez de la mañana en el fraccionamiento antes en mención en la calle Del Parque y Del Marques al interior de domicilio hasta donde acudieron policías municipales. Policías indicaron que recibieron el reporte al parecer por parte de algún familiar que acudió a la vivienda y encontró al hombre sin vida, tras confirmar el hallazgo se acordono el área de inmediato para evitar el paso de la gente. Agentes ministeriales acudieron para realizar las primeras líneas de investigación y hacer las entrevistas necesarias a los vecinos para saber si escucharon alguna detonación de arma de fuego o problemas al interior del domicilio.", address: "CALLE DEL PARQUE Y DEL MARQUES ", suburb: "VALLE VERDE ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "El hallazgo del cadáver se realizó antes de las diez de la mañana en el fraccionamiento antes en mención en la calle Del Parque y Del Marques al interior de domicilio hasta donde acudieron policías municipales. Policías indicaron que recibieron el reporte al parecer por parte de algún familiar que acudió a la vivienda y encontró al hombre sin vida, tras confirmar el hallazgo se acordono el área de inmediato para evitar el paso de la gente. Agentes ministeriales acudieron para realizar las primeras líneas de investigación y hacer las entrevistas necesarias a los vecinos para saber si escucharon alguna detonación de arma de fuego o problemas al interior del domicilio.", backup_file: nil, source: "http://puentelibre.mx/_notas/1574213", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.38426303863525", latitude: "31.72734585276098", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MED