  {priority_id: 10000, event_date: "2014-03-05 02:27:49", description: "MUJER MUERTA POR ARMA DE FUEGO ", address: nil, suburb: "FRENTE A CENTRO DE SALUD ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "", backup_file: nil, source: "http://laopcion.com.mx/noticia/30105/otra-joven-ejecutada-afuera-de-clinica-en-carichi", area_id: 10003, crime_id: 1, township_id: 12, locality_id: nil, place_id: nil, analyst_id: 24, status_id: 10023, longitude: "-106.9024658203125", latitude: "27.848790459862073", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS MUJER MUERTA POR ARMA DE FUEGO   OCCIDENTE HOMICIDIO  A0-MEDIOS MUJER MUERTA POR ARMA DE FUEGO  OCCIDENTE HOMICIDIO  A023 MUJER MUERTA POR ARMA DE FUEGO  OCCIDENTE HOMICIDIO ", raw_rnum_: 318},
  {priority_id: 10000, event_date: "2014-03-05 03:21:14", description: "MUJER MUERTA POR ARMA DE FUEGO. \r\n\r\nFrente a un parque del fraccionamiento Hacienda de las Torres donde jugaban niños, una mujer fue asesinada a balazos la noche de este martes. El crimen se reportó alrededor de las 8 de noche en las calles Fragata y Vela. El cuerpo quedó tirado en una acera. Habitantes del sector señalaron que la muje, vivía a media cuadra del lugar donde fue asesinada y donde también hace cuatro meses mataron a su esposo. La víctima era conocida en el fraccionamiento por dedicarse a vender “papas locas” y dulces en las escuelas del sector. Tras reportarse el crimen, acudieron al lugar elementos de la Secretaría de Seguridad Pública Municipal quienes esposaron a dos mujeres identificadas como familiares de la víctima y se las llevaron en una unidad sin que se especificara si tenían relación con el asesinato. Sin embargo, testigos del crimen señalaron a los tripulantes de dos vehículos, una Van color verde y un Jetta negro, como los autores del asesinato.", address: "VELERO ESQ. FRAGATA ", suburb: "HACIENDA LAS TORRES ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "", backup_file: nil, source: "http://puentelibre.mx/_notas/1576091", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.4089822769165", latitude: "31.613590423510182", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS MUJER MUERTA POR ARMA DE FUEGO.  VELERO ESQ. FRAGATA  NORTE HOMICIDIO  A0-MEDIOS MUJER MUERTA POR ARMA DE FUEGO.  VELERO ESQ. FRAGATA  NORTE HOMICIDIO  A036 MUJER MUERTA POR ARMA DE FUEGO.  VELERO ESQ. FRAGATA  NORTE HOMICIDIO ", raw_rnum_: 319},
  {priority_id: 10000, event_date: "2014-03-05 12:44:27", description: "MUERTO  POR ARMA DE FUEGO .\r\n\r\nSe registró a las cinco de la mañana de este miércoles cinco de marzo. Vecinos del sector reportaron que se escucharon varias detonaciones de arma de fuego, al arribar policías municipales a la zona localizaron el cuerpo sin vida de hombre en el cruce de las calles Che Guevara y Rubén Darío. Ante el hallazgo se realizó el reporte a la Fiscalía para que momentos después acudieran agentes investigadores para iniciar con los trabajos en la escena del crimen. Peritos aseguraron en total seis casquillos de nueve milímetros los cuales se añadieron a la carpeta de investigación, mientras que el cuerpo de la víctima se levantó por parte de personal del Semefo para realizar la necropsia. Familiares del", address: "RUBEN DARIO ESQ. CHE GUEVARA ", suburb: "ZARAGOZA ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "EJECUTAN A HOMBRE ESTA MADRUGADA EN LA COLONIA PAPALOTE", backup_file: nil, source: "066", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.3552737236023", latitude: "31.63764425842662", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS MUERTO  POR ARMA DE FUEGO . RUBEN DARIO ESQ. CHE GUEVARA  NORTE HOMICIDIO  A0-MEDIOS MUERTO  POR ARMA DE FUEGO . RUBEN DARIO ESQ. CHE GUEVARA  NORTE HOMICIDIO  A0-MEDIOS MUERTO  POR ARMA DE FUEGO . RUBEN DARIO ESQ. CHE GUEVARA  NORTE HOMICIDIO  A036 MUERTO  POR ARMA DE FUEGO . RUBEN DARIO ESQ. CHE GUEVARA  NORTE HOMICIDIO ", raw_rnum_: 320},
