  {priority_id: 10000, event_date: "2014-02-25 22:22:41", description: "LESIONADO POR ARMA DE FUEGO . \r\n\r\nDe acuerdo con primeras versiones, esta tarde, sujetos con armas de fuego interceptaron a la víctima en el cruce de las calles Melchor Múzquiz y Cusihuiriachi de la colonia Anáhuac.\r\n\r\nVecinos del sector comentaron que escucharon alrededor de ocho detonaciones de arma de fuego, por lo que dieron aviso a las autoridades.\r\n\r\nLa víctima vestía pantalón y sudadera en color negro y hasta el momento se desconoce su identidad.\r\n\r\nEl cuerpo yacía bocabajo en la vía pública, mientras elementos de la Policía Municipal y la Fiscalía del Estado resguardaban el perímetro en espera de la Unidad Especializada en Escena del Crimen.\r\n\r\nPersonal del Servicio Médico Forense fue el responsable de retirar el cuerpo de la vía pública para trasladarlo a sus instalaciones.\r\n", address: "5 FEB Y CUSIHUIRACHI", suburb: "ANAHUAC ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "De acuerdo con primeras versiones, esta tarde, sujetos con armas de fuego interceptaron a la víctima en el cruce de las calles Melchor Múzquiz y Cusihuiriachi de la colonia Anáhuac.\r\n\r\nVecinos del sector comentaron que escucharon alrededor de ocho detonaciones de arma de fuego, por lo que dieron aviso a las autoridades.\r\n\r\nLa víctima vestía pantalón y sudadera en color negro y hasta el momento se desconoce su identidad.\r\n\r\nEl cuerpo yacía bocabajo en la vía pública, mientras elementos de la Policía Municipal y la Fiscalía del Estado resguardaban el perímetro en espera de la Unidad Especializada en Escena del Crimen.\r\n\r\nPersonal del Servicio Médico Forense fue el responsable de retirar el cuerpo de la vía pública para trasladarlo a sus instalaciones.\r\n", backup_file: nil, source: "http://puentelibre.mx/_notas/1568700", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.481112241745", latitude: "31.71399425373079", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS LESIONADO POR ARMA DE FUEGO .  5 FEB Y CUSIHUIRACHI NORTE HOMICIDIO  A0-MEDIOS LESIONADO POR ARMA DE FUEGO .  5 FEB Y CUSIHUIRACHI NORTE HOMICIDIO  A036 LESIONADO POR ARMA DE FUEGO .  5 FEB Y CUSIHUIRACHI NORTE HOMICIDIO ", raw_rnum_: 322},
  {priority_id: 10001, event_date: "2014-02-27 21:34:26", description: "LOS ARRESTAN EN POSESIÓN DE UNA ESCUADRA 9MM.\r\nDos sujetos que circulaban a exceso de velocidad en un vehículo fueron aprehendidos por el delito de portación ilegal de arma de fuego, informó la Policía Estatal Única.\r\n\r\n Los arrestados son José Iván García Maldonado de 24 años y Joel Roberto Solís Muñoz de 21, a quienes se detuvo anoche en las calles Tucán y Cuarta de la colonia Granjas de Chapultepec, agregó.\r\n\r\n Ellos viajaban en un Volkswagen Jetta, azul, modelo 2003, con permiso provisional para circular con número 3500-73-02-15 que era conducido a exceso de velocidad, continuó.\r\n\r\n“Se le hizo el alto y cuadras más adelante fue alcanzado luego de varios señalamientos a través del altavoz”, añadió.\r\n\r\n Entre los asientos delanteros, junto al freno de mano, se halló una pistola escuadra calibre 9 milímetros, de color negro con plateado, con su cargador y nueve cartuchos.\r\n\r\n Los sujetos fueron detenidos y se aseguró el arma y el vehículo, dio a conocer. En seguida se consignó a ambos al agente del Ministerio Público Federal", address: "TUCAN Y CUARTA", suburb: "GRANJAS DE CHAPULTEPEC", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Dos sujetos que circulaban a exceso de velocidad en un vehículo fueron aprehendidos por el delito de portación ilegal de arma de fuego, informó la Policía Estatal Única.\r\n\r\n Los arrestados son José Iván García Maldonado de 24 años y Joel Roberto Solís Muñoz de 21, a quienes se detuvo anoche en las calles Tucán y Cuarta de la colonia Granjas de Chapultepec, agregó.\r\n\r\n Ellos viajaban en un Volkswagen Jetta, azul, modelo 2003, con permiso provisional para circular con número 3500-73-02-15 que era conducido a exceso de velocidad, continuó.\r\n\r\n“Se le hizo el alto y cuadras más adelante fue alcanzado luego de