  {priority_id: 10000, event_date: "2014-03-24 16:15:33", description: "BALACERA EN PASEO DE LA VICTORIA \r\nEl hecho violento lo registraron a las nueve de la mañana en la Paseo de la Victoria y calle Tapioca en gasolinera en donde quedó el cuerpo de la mujer quien al parecer intentó huir. También dos hombres resultaron con lesiones tras recibir los impactos de bala en diferentes partes del cuerpo a quienes trasladaron a recibir atención médica a hospital de la ciudad y los reportan como graves. Policías municipales arribaron al lugar para levantar la información por parte de testigos e iniciar con los operativos en el sector para poder dar con los responsables, pero hasta el momento no reportan detenciones. Elementos de la Fiscalía General del Estado Zona Norte acudieron para acordonar la escena del crimen y cerrar el acceso sobre Paseo de la Victoria de norte a sur. Peritos comenzaron con el aseguramiento de la evidencia en el lugar así como la toma de fotografías de la escena del crimen como parte de la investigación.", address: "PASEO DE LA VCITORIA Y TAPIOCA", suburb: "COL. PARQUE INDUSTRIAL LAS LOMAS ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "", backup_file: nil, source: "http://puentelibre.mx/_notas/1594940", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.39512062072754", latitude: "31.667810098618855", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS BALACERA EN PASEO DE LA VICTORIA  PASEO DE LA VCITORIA Y TAPIOCA NORTE HOMICIDIO  A0-MEDIOS BALACERA EN PASEO DE LA VICTORIA  PASEO DE LA VCITORIA Y TAPIOCA NORTE HOMICIDIO  A0-MEDIOS BALACERA EN PASEO DE LA VICTORIA  PASEO DE LA VCITORIA Y TAPIOCA NORTE HOMICIDIO  A036 BALACERA EN PASEO DE LA VICTORIA  PASEO DE LA VCITORIA Y TAPIOCA NORTE HOMICIDIO ", raw_rnum_: 325},
