  {priority_id: 10000, event_date: "2014-03-25 03:10:22", description: "EJECUTAN A CIGARRERO (ZN JUáREZ)", address: "SAN LORENZO Y EL EDIFICIO GARDIé", suburb: "COL. PARQUE INDUSTRIAL LOS FUENTES.", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "ES UN MASCULINO ESTA SOBRE LA BANQUETA, LOS RESPONSABLES LLEGARON A BORDO, HUYERON RUMBO AL CENTRO SOBRE LA CALLE PASEO TRIUNFO DE LA REPúBLICA, FUERON 2 MASCULINOS DE ENTRE 30-35 AñOS.\r\n\r\nUn hombre fue ejecutado de tres tiros en la cabeza cuando caminaba por la Curva de San Lorenzo la noche de ayer. La víctima fue identificada por vecinos del sector como “El Marracas” y se dedicaba presuntamente a vender periódicos y cigarros en la zona, pero en esos momentos se dirigía a su domicilio con una botella de mezcal en la mano. Dos hombres que tripulaban un auto Acura de color oscuro hicieron un semialto y le dispararon en cinco ocasiones con un arma corta calibre .9 milímetros, señalaron agentes preventivos. Tres de las balas le dieron en la cabeza, el hombre cayó muerto sobre la avenida Fray Junípero Serra, casi esquina con Paseo Triunfo de la República, mientras los agresores se alejaron a toda velocidad del lugar. Los casquillos percutidos quedaron diseminados en la calle a unos metros del cuerpo del hombre asesinado. Los hechos se registraron a las 8:15 de la noche ante la mirada de decenas de automovilistas que a esa hora circulaban por el sector. La zona fue acordonada y los carriles de circulación de oriente a poniente de la Paseo Triunfo fueron cerrados, así como la avenida Fray Junípero Serra, la cual fue bloqueada desde la calle Valle de Juárez, frente al templo de San Lorenzo. Al lugar acudió el secretario de Seguridad Pública Municipal, César Muñoz, así como al menos una docena de patrullas de esa misma corporación, quienes iniciaron un operativo especial para ubicar a los responsables. Sin embargo, al cierre de esta edición no reportan arrestos.", backup_file: nil, source: "http://tiempo.com.mx/_notas/1753580", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.42477512359619", latitude: "31.739299514342928", gmaps: nil, tramo_carretero: nil, searchable: "  A026 EJECUTAN A CIGARRERO (ZN JUáREZ) SAN LORENZO Y EL EDIFICIO GARDIé NORTE HOMICIDIO ES UN MASCULINO ESTA SOBRE LA BANQUETA, LOS RESPONSABLES LLEGARON A BORDO, HUYERON RUMBO AL CENTRO SOBRE LA CALLE PASEO TRIUNFO DE LA REPúBLICA, FUERON 2 MASCULINOS DE ENTRE 30-35 AñOS. A026 EJECUTAN A CIGARRERO (ZN JUáREZ) SAN LORENZO Y EL EDIFICIO GARDIé NORTE HOMICIDIO ES UN MASCULINO ESTA SOBRE LA BANQUETA, LOS RESPONSABLES LLEGARON A BORDO, HUYERON RUMBO AL CENTRO SOBRE LA CALLE PASEO TRIUNFO DE LA REPúBLICA, FUERON 2 MASCULINOS DE ENTRE 30-35 AñOS. A036 EJECUTAN A CIGARRERO (ZN JUáREZ) SAN LORENZO Y EL EDIFICIO GARDIé NORTE HOMICIDIO ES UN MASCULINO ESTA SOBRE LA BANQUETA, LOS RESPONSABLES LLEGARON A BORDO, HUYERON RUMBO AL CENTRO SOBRE LA CALLE PASEO TRIUNFO DE LA REPúBLICA, FUERON 2 MASCULINOS DE ENTRE 30-35 AñOS. A036 EJECUTAN A CIGARRERO (ZN JUáREZ) SAN LORENZO Y EL EDIFICIO GARDIé NORTE HOMICIDIO ES UN MASCULINO ESTA SOBRE LA BANQUETA, LOS RESPONSABLES LLEGARON A BORDO, HUYERON RUMBO AL CENTRO SOBRE LA CALLE PASEO TRIUNFO DE LA REPúBLICA, FUERON 2 MASCULINOS DE ENTRE 30-35 AñOS.", raw_rnum_: 327},
