  {priority_id: 10000, event_date: "2014-03-25 19:36:35", description: "HOMICIDIO VARóN (ZN JUáREZ)", address: "CEDROS DEL SOLAR # 2184 ESQUINA CON MONTES DEL CANTAL", suburb: "COL. URBIVILLA DEL CEDRO", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Las autoridades investigan la muerte de un hombre que fue encontrado en su casa este mediodía atado de manos y pies, y que fue severamente golpeado hasta privarlo de la vida. La vivienda se ubica en el cruce de las calles Cedros del Solar y Montes del Cantal del fraccionamiento Urbivilla del Cedro II, al sur de la ciudad. A dicho lugar acudieron unos familiares y lo encontraron muerto, por lo cual llamaron a las autoridades, según se dio a conocer. La vivienda fue resguardada por elementos de la Policía municipal en tanto arriban los agentes ministeriales que van a hacerse cargo de la investigación. Únicamente se dio a conocer que se trata del cuerpo de un hombre y que fue golpeado severamente hasta causarle la muerte.\r\n", backup_file: nil, source: "066", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.33203506469727", latitude: "31.56784084450157", gmaps: nil, tramo_carretero: nil, searchable: "  A026 HOMICIDIO VARóN (ZN JUáREZ) CEDROS DEL SOLAR # 2184 ESQUINA CON MONTES DEL CANTAL NORTE HOMICIDIO UN MASCULINO TIRADO SOBRE EL PISO DEL ÁREA DE LA SALA ENRREDADO CON COBIJAS MISMO CONTABA CON MANCHAS HEMÁTICAS YA SECAS\r\nSE APRECIAN HUELLAS DE VIOLENCIA COMUNICA UNIDAD EL CUERPO EN EVIDENTE ESTADO DE DESCOMPOSICIÓN COMUNICA LA UNIDAD QUE ES POSITIVO SE LOCALIZA UN MASCULINO EN EL INTERIOR DEL DOMICILIO YA SIN SIGNOS VITALES MANIATADO CON VISIBLES HUELLAS DE VIOLENCIA\r\n A026 HOMICIDIO VARóN (ZN JUáREZ) CEDROS DEL SOLAR # 2184 ESQUINA CON MONTES DEL CANTAL NORTE HOMICIDIO UN MASCULINO TIRADO SOBRE EL PISO DEL 