  {priority_id: 10000, event_date: "2014-03-06 20:18:27", description: "ENCUENTRAN CADáVER DE HOMBRE EN UN BOTE .", address: "JUAN BALDERAS Y PABLO CUARON ", suburb: "FRANCISCO I.  MADERO", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Un hombre fue asesinado, cortado en pedazos y sus restos depositados en un tambo negro de plástico, el cual quedó abandonado en la vía pública frente al Centro Comunitario Francisco I. Madero. La escueta información dada por la Policía indica que se trata de un hombre descuartizado cuyos miembros fueron envueltos en una sábana o cobija de hule. El recipiente se ubica en un terreno baldío, junto a un dique pluvial, justo en la calle Navario, entre Juan Balderas y Emiliano Zapato de la colonia Francisco I. Madero. Vecinos dijeron que el tambo fue dejado allí desde anoche por personas desconocidas y los perros callejeros lo derribaron esta mañana, luego empezaron a mordisquear el contenido. Una persona advirtió que se trata de los restos de una persona y llamó a las autoridades.", backup_file: nil, source: "http://puentelibre.mx/_notas/1578062", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.50869607925415", latitude: "31.739573244253446", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS ENCUENTRAN CADáVER DE HOMBRE EN UN BOTE . JUAN BALDERAS Y PABLO CUARON  NORTE HOMICIDIO  A0-MEDIOS ENCUENTRAN CADáVER DE HOMBRE EN UN BOTE . JUAN BALDERAS Y PABLO CUARON  NORTE HOMICIDIO  A0-MEDIOS ENCUENTRAN CADáVER DE HOMBRE EN UN BOTE . JUAN BALDERAS Y PABLO CUARON  NORTE HOMICIDIO  A0-MEDIOS ENCUENTRAN CADáVER DE HOMBRE EN UN BOTE . JUAN BALDERAS Y PABLO CUARON  NORTE HOMICIDIO  A036 ENCUENTRAN CADáVER DE HOMBRE EN UN BOTE . JUAN BALDERAS Y PABLO CUARON  NORTE HOMICIDIO ", raw_rnum_: 334},
