  {priority_id: 10000, event_date: "2014-03-06 16:24:58", description: "EJECUTAN A HOMBRE AFUERA DE ESTUDIO FOTOGRAFICO. \r\nUn hombre que intentaba escapar de un grupo de extorsionadores que viajaban en una camioneta, fue atropellado y rematado a balazos en la colonia Tierra Nueva.\r\nLos hechos se registraron alrededor de las 7:30 de la tarde en la calle Puerto de Palos .\r\nDe acuerdo con testigos, la víctima identificada por sus familiares como Nicolás Rodríguez, de 30 años de edad, se dedicaba a la venta de hamburguesas frente a una tienda de autoservicio y era víctima de extorsión.\r\nAl caminar por la calle, se percató de la presencia de una camioneta Cherokee color café de modelo antiguo e intentó correr.\r\nSin embargo fue embestido y posteriormente rematado con al menos seis disparos.\r\nAl lugar acudieron elementos de todas las corporaciones quienes realizaron un operativo especial para capturar a los responsables, pero no se reportan detenciones.\r\nAllegados al ultimado afirmaron que el comerciante era victima de extorsionadores, cobradores de la “cuota”.", address: "PUERTO DE PALOS", suburb: "GLADIOLAS", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Allegados al ultimado afirmaron que el comerciante era victima de extorsionadores, cobradores de la “cuota”.", backup_file: nil, source: "http://puentelibre.mx/_notas/1578471", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.34636878967285", latitude: "31.6248827057084", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS EJECUTAN A HOMBRE AFUERA DE ESTUDIO FOTOGRAFICO.  PUERTO DE PALOS NORTE HOMICIDIO  A0-MEDIOS EJECUTAN A HOMBRE AFUERA DE ESTUDIO FOTOGRAFICO.  PUERTO DE PALOS NORTE HOMICIDIO  A036 EJECUTAN A HOMBRE AFUERA DE ESTUDIO FOTOGRAFICO.  PUERTO DE PALOS NORTE HOMICIDIO ", raw_rnum_: 336},
  {priority_id: 10000, event_date: "2014-03-08 17:22:20", description: " BALEAN A ADOLESCENTE EN LA DIVISION DEL NORTE ", address: "FELIPE ANGELES Y TERCERA ", suburb: "DIVISION DEL NORTE ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "Una adolescente de 16 anos fue lesionada a balazos a media noche en la colonia División del Norte.\r\nLos presuntos responsables lograron darse a la fuga, pero no se dijo en que vehículo viajaban.\r\nLos hechos se registraron en las calles Felipe Ángeles y Tercera.\r\nEn el lugar trascendió que el objetivo no era la adolescente sino otra persona.\r\nLa afectada fue trasladada por paramédicos del cuerpo de rescate al Hospital Infantil.", backup_file: nil, source: "http://www.lapoliciaca.com/nota-roja/balean-a-adolescente-en-colonia-division-del-norte/", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.4479386806488", latitude: "31.70159005451513", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS  BALEAN A ADOLESCENTE EN LA DIVISION DEL NORTE  FELIPE ANGELES Y TERCERA  NORTE HOMICIDIO  A0-MEDIOS  BALEAN A ADOLESCENTE EN LA DIVISION DEL NORTE  FELIPE ANGELES Y TERCERA  NORTE HOMICIDIO  A036  BALEAN A ADOLESCENTE EN LA DIVISION DEL NORTE  FELIPE ANGELES Y TERCERA  NORTE HOMICIDIO ", raw_rnum_: 337},
