  {priority_id: 10001, event_date: "2014-02-27 21:37:53", description: "DESARTICULAN A BANDA DE SECUESTRADORES DE \"LA PATRONA\"\r\nLA FISCALíA DEL ESTADO LOGRó HOY LA DESARTICULACIóN DE BANDA DE SECUESTRADORES DENOMINADA \"LA PATRONA\", A QUIENES SE LES VINCULA CON CINCO PLAGIOS DE AMIGOS Y FAMILIARES DE EMPRESARIOS DE ESTA CIUDAD.\r\n", address: nil, suburb: "CIUDAD ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "SEIS PRESUNTOS INTEGRANTES DE UNA BANDA DE SECUESTRADORES Y HOMICIDAS LIDERADA POR UNA MUJER, FUERON DETENIDOS POR AGENTES DE LA FISCALíA GENERAL DEL ESTADO.\r\n\r\nDE ACUERDO CON PERSONAL DE COMUNICACIóN SOCIAL DE LA DEPENDENCIA ESTATAL, LA BANDA DE “LA PATRONA” PLAGIó A SUS PROPIOS AMIGOS Y FAMILIARES ASí COMO A EMPRESARIOS FRONTERIZOS Y DE CUAUHTéMOC, QUE VISITABAN ESTA CIUDAD.\r\n\r\nLOS DETENIDOS SON: CLAUDIA ELVIRA LóPEZ GUTIéRREZ ALIAS “LA PATRONA”, DE 32 AñOS, SEñALADA COMO LíDER DEL GRUPO CRIMINAL; RICARDO FLORES VENEGAS, “EL RICHI”; DANIEL ADáN CHáIREZ AGUILAR; ALAN DANIEL DELGADO CARRILLO, “EL TROY”; OMAR SáNCHEZ VILLA Y DULCE CONCEPCIóN GUADALUPE ARGUIJO IBARRA.\r\n", backup_file: nil, source: "http://diario.mx/Local/2014-02-27_f0f23264/plagio-banda-de-la-patrona-a-sus-familiares-y-conocidos/ El Diario | 2014-02-27 | 23:06", area_id: 10000, crime_id: 12, township_id: 38, locality_id: 7391, place_id: nil, analyst_id: 3, status_id: 10023, longitude: "-106.4080810546875", latitude: "31.639352364896208", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-NORTE DESARTICULAN A BANDA DE SECUESTRADORES DE \"LA PATRONA\"\r\nLA FISCALíA DEL ESTADO LOGRó HOY LA DESARTICULACIóN DE BANDA DE SECUESTRADORES DENOMINADA \"LA PATRONA\", A QUIENES SE LES VINCULA CON CINCO PLAGIOS DE AMIGOS Y FAMILIARES DE EMPRESARIOS DE ESTA CIUDAD.\r\n  Juárez NORTE SECUESTRO SEIS PRESUNTOS INTEGRANTES DE UNA BANDA DE SECUESTRADORES Y HOMI