  {priority_id: 10000, event_date: "2014-03-03 18:00:00", description: "ENCUENTRAN CADáVER EN TAPIAS  \r\nEl hallazgo se realizó antes de las nueve de la mañana en el cruce de las calles Arcadia y Ejido San Juanito del fraccionamiento antes en mención. Policías municipales fueron los primero en arribar al lugar en donde encontraron el cuerpo del sexo masculino a quien aún no identifica ya que no portaba credencial. Vecinos indicaron que el hombre podría ser a alguien que conocen como \"El Junior\" quien vive por el sector y tienen varias semanas sin saber de él. Peritos aseguraron en el lugar aproximadamente cuatro casquillos en la escena del crimen por lo que se cree que pudieron privarlo de la vida en el lugar. El cadáver se encontraba envuelto en cobija a cuadros y presentaba varios impactos de bala, esta víctima se suma a las otras dos del mes de marzo que se localizaron el sábado por la mañana al interior de cajuela de automóvil.", address: "ARCADIA Y EJIDO SAN JUANITO ", suburb: "PRADERAS DE HENEQUEN ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "El hallazgo se realizó antes de las nueve de la mañana en el cruce de las calles Arcadia y Ejido San Juanito del fraccionamiento antes en mención. Policías municipales fueron los primero en arribar al lugar en donde encontraron el cuerpo del sexo masculino a quien aún no identifica ya que no portaba credencial. Vecinos indicaron que el hombre podría ser a alguien que conocen como \"El Junior\" quien vive por el sector y tienen varias semanas sin saber de él. Peritos aseguraron en el lugar aproximadamente cuatro casquillos en la escena del crimen por lo que se cree que pudieron privarlo de la vida en el lugar. El cadáver se encontraba envuelto en cobija a cuadros y presentaba varios impactos de bala, esta víctima se suma a las otras dos del mes de marzo que se localizaron el sábado por l