  {priority_id: 10001, event_date: "2014-03-13 20:59:30", description: "El pleito por la reubicación de comerciantes ambulantes en la zona centro tomó un giro violento este jueves.\r\nUn vendedor de comida rápida fue herido de dos disparos en la cabeza y agoniza en un hospital.\r\nEl ataque se produjo entre las calles La Paz y Corregidora, donde el herido tenía su puesto de gorditas.\r\nUn solitario sicario llegó hasta el lugar y disparó en corto a la cabeza del comerciante informal apodo “El gordo”.\r\nEl herido fue atendido por paramédicos de la Cruz Roja, quienes lo trasladaron en ‘código rojo’ al Hospital General.\r\nEl hecho se produce cuando los ambulantes están en pie de guerra para no ser sacados de la zona por el Gobierno Municipal.\r\nEs en esa área donde fluye toda clase de tráfico ilegal", address: "LA PAZ ESQ. MIGUEL AHUMADA", suburb: "CENTRO ", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "", backup_file: nil, source: "http://lapolaka.com/narcoavispero-en-el-centro/", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.48365497589111", latitude: "31.735722702505488", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS LESIONADO POR ARMA DE FUEGO  LA PAZ ESQ. MIGUEL AHUMADA NORTE LESIONES  A0-MEDIOS LESIONADO POR ARMA DE FUEGO  LA PAZ ESQ. MIGUEL AHUMADA NORTE LESIONES  A036 LESIONADO POR ARMA DE FUEGO  LA PAZ ESQ. MIGUEL AHUMADA NORTE LESIONES  A036 El pleito por la reubicación de comerciantes ambulantes en la zona centro tomó un giro violento este jueves.\r\nUn vendedor de comida rápida fue herido de dos disparos en la cabeza y agoniza en un hospital.\r\nEl ataque se produjo entre las calles La Paz y Corregidora, donde el herido tenía su puesto de gorditas.\r\nUn solitario sicario llegó hasta el lugar y disparó en corto a la cabeza del co