  {priority_id: 10000, event_date: "2014-03-29 06:08:30", description: "LO EJECUTAN EN SU DOMICILIO (ZS MATAMOROS)", address: "AV. PEINADO ESQUINA CON PRIVADA DEL ROSAL", suburb: nil, locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "UN HOMBRE FUE EJECUTADO EN EL INTERIOR DE SU CASA POR UN COMANDO ARMADO QUIENES LE DISPARARON EN SU RECáMARA; LES PERDONARON LA VIDA A LAS MUJERES DE LA VIVIENDA. EL CUERPO PRESENTA MúLTIPLES HERIDAS POR PROYECTIL DE ARMA DE FUEGO, LOCALIZADAS EN DIFERENTES PARTES.\r\nUNA MUJER DE 24 AñOS DE EDAD, ESPOSA DEL HOY OCCISO, DIJO QUE A LAS 23:00 HORAS SE ESCUCHó UN RUIDO EN LA LáMINA, SALIó A VER QUE PASABA, Y UNA HERMANA DE ELLA, DE 23 AñOS DE EDAD ENCONTRó AFUERA A DOS PERSONAS QUE VESTíAN TODO DE NEGRO, QUE PORTABAN RIFLES Y POR LA FUERZA SE METIERON A LA CASA Y LES DIJERON A LAS MUJERES QUE NO SE METIERAN. LOS DELINCUENTES SE DIRIGIERON A DONDE ESTABA MARTíN Y LO BAJARON DE LA CAMA PARA REALIZARLE MúLTIPLES DISPAROS HASTA QUE FALLECIó.\r\nEN EL LUGAR SE ASEGURARON VARIOS CASQUILLOS PERCUTIDOS DEL CALIBRE 7.62X39 MM (DE CUERNO DE CHIVO), Y VARIOS CASQUILLOS PERCUTIDOS DEL CALIBRE .223 MM, ASí COMO TRES CARTUCHOS úTILES DEL CALIBRE .223 MM. \r\n", backup_file: nil, source: "http://laopcion.com.mx/noticia/33600/lo-bajan-de-la-cama-para-ejecutarlo-perdonan-la-vida-a-dos-mujeres", area_id: 10002, crime_id: 1, township_id: 46, locality_id: nil, place_id: nil, analyst_id: 17, status_id: 10023, longitude: "-105.5857104063034", latitude: "26.767936697205112", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-2 LO EJECUTAN EN SU DOMICILIO (ZS MATAMOROS) AV. PEINADO ESQUINA CON PRIVADA DEL ROSAL SUR HOMICIDIO UN HOMBRE FUE EJECUTADO EN EL INTERIOR DE SU CASA POR UN COMANDO ARMADO QUIENES LE DISPARARON EN SU RECáMARA; LES PERDONARON LA VIDA A LAS MUJERES DE LA VIVIENDA. EL CUERPO PRESENTA MúLTIPLES HERIDAS POR PROY