  {priority_id: 10000, event_date: "2014-04-04 23:27:03", description: "HOMICIDIO POR EJECUCIóN \r\nLUEGO DE 4 DÍAS SIN HOMICIDIOS, UN PISTOLERO MATÓ ESTA TARDE AL EMPLEADO DE UNA DESPONCHADORA EN LA COLONIA CARLOS CASTILLO PERAZA.\r\nERNESTO VARELA DE 24 AÑOS, SE ENCONTRABA DESCARGANDO LLANTAS DE UN CAMIÓN EN EL NEGOCIO UBICADO EN LAS CALLES MANUEL TALAMÁS CAMANDARI, A POCOS METROS DE LA CALLE RAFAEL TERRAZAS CIENFUEGOS.\r\nEN ESO FUE ABORDADO POR UNO DE DOS SUJETOS QUE LLEGARON A BORDO DE UNA CAMIONETA PARA DISPARARLE A LA CABEZA.\r\nPOLICÍAS MUNICIPALES REALIZARON UN EXTENSO OPERATIVO Y DETUVIERON A LOS RESPONSABLES CUANDO HUÍAN SOBRE EL BULEVAR INDEPENDENCIA, SE DIO A CONOCER DE MANERA\r\n", address: "BLVD. TALAMAS  CAMANDARI ESQ. MAR DEL SUR ", suburb: "PARAJES DEL SUR", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "VICTIMA - NÉSTOR HUGO PIÑA FAVELA", backup_file: nil, source: "http://puentelibre.mx/_notas/1606360", area_id: 10000, crime_id: 1, township_id: nil, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.37145280838013", latitude: "31.588351424260562", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS HOMICIDIO POR EJECUCIóN  BLVD. TALAMAS  CAMANDARI ESQ. MAR DEL SUR  NORTE HOMICIDIO  A0-MEDIOS HOMICIDIO POR EJECUCIóN  BLVD. TALAMAS  CAMANDARI ESQ. MAR DEL SUR  NORTE HOMICIDIO  A0-MEDIOS HOMICIDIO POR EJECUCIóN  BLVD. TALAMAS  CAMANDARI ESQ. MAR DEL SUR  NORTE HOMICIDIO  A036 HOMICIDIO POR EJECUCIóN  BLVD. TALAMAS  CAMANDARI ESQ. MAR DEL SUR  NORTE HOMICIDIO ", raw_rnum_: 372},
  {priority_id: 10000, event_date: "2014-04-06 04:26:02", description: "BALEAN A COCINERO EN BAR (ZN JUAREZ)\r\nTIROTEADO AL EXTERIOR DEL BAR LAS CHORREDAS, UN EMPLEADO DEL LUGAR FUE HOSPITALIZADO DURANTE LA NOCHE CON LESIONES GRAVES.\r\nEL HOMBRE, DE OFICIO COCINERO, PLATICABA CON SU ESPOSA CUANDO DE PRONTO LLEGÓ UN INDIVIDUO ARMADO Y LE REALIZÓ VARIOS DISPAROS.\r\nSANGRANDO, EL AFECTADO INGRESÓ A LA COCINA DE ESE RESTAURANTE BAR, UBICADO EN CALLES RAMÓN RAYÓN Y PRADERAS DE LOS ALAMOS, DONDE SUS COMPAÑEROS LO AUXILIARON Y TRASLADARON A UNA CLÍNICA DEL IMSS.\r\nAGENTES MUNICIPALES ACORDONARON LA ZONA MIENTRAS QUE ELEMENTOS MINISTERIALES REALIZABAN LAS PRIMERAS INVESTIGACIONES.\r\n", address: "CALLES RAMóN RAYóN Y PRADERAS", suburb: "LOS ALAMOS", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "LOS HECHOS OCURRIERON EN EL EXTERIOR DE LA PARTE TRASERA DE LA NEGOCIACIóN \"LAS CHORREADAS\". EL COCINERO, PLATICABA CON SU ESPOSA CUANDO DE PRONTO LLEGó UN INDIVIDUO ARMADO Y LE REALIZó VARIOS DISPAROS. LOS RESPONSABLES HUYERON A BORDO DE UNA CAMIONETA OSCURA, UNO DE LOS MASCULINOS DE COMPLEXIóN  ALTO Y DELGADO. ANDABA RONDANDO LA COLONIA. SE INFORMA QUE EL RESPONSABLE CIRCULA A BORDO DE UN CARRO AZUL CON PLACAS DE ARIZONA INFORMAN POR FRECUENCIA DE MANDOS QUE AL LESIONADO LO LLEVAN EN VEHíCULO PARTICULAR A LA CLíNICA 66 A BORDO DE UNA F-150 COLOR GRIS, INFORMAN POR FRECUENCIA DE MANDOS QUE EL LESIONADO ES EL COCINERO DEL LOCAL, EL MISMO PRESENTA 4 IMPACTOS DE ARMA DE  FUEGO UNO EN EL BRAZO DERECHO, UNO EN EL CORAZóN, UNO EN EL ANTE BRAZO DERECHO, UNO EN EL ANTEBRAZO IZQUIERDO Y EL ULTIMO EN EL BRAZO IZQUIERDO Y SE LOCALIZARON EN EL LUGAR 4 CASQUILLOS PERCUTIDOS AL PARECER CALIBRE 40 EL MISMO FUE TRASLADADO A LA CLíNICA IMSS 66.", backup_file: nil, source: "http://laopcion.com.mx/noticia/34853/balean-a-cocinero-de-bar-en-juarez", area_id: 10000, cr