  {priority_id: 10000, event_date: "2014-03-30 00:35:00", description: "LO EJECUTAN MIENTRAS CAMINABA EN PARQUE (ZN JUáREZ)\r\nUn hombre fue ejecutado durante la tarde del pasado sábado en calles de la colonia Manuel Gómez Morín, en esta ciudad fronteriza.\r\nLos hechos ocurrieron en un parque ubicado en el cruce de calles Rafael Preciado Hernández y Alberto Vázquez. La víctima, de entre los 20 y 25 años de edad, se encontraba en el sitio cuando un individuo se le próximo y realizó varios disparos a la cabeza.\r\nAl lugar acudieron elementos de diversas corporaciones policiales, entre ellos personal de Semefo, que trasladaron el cuerpo al anfiteatro de la ciudad.\r\nHasta el momento el cuerpo no ha sido identificado y se desconoce el paradero del agresor.", address: nil, suburb: "MANUEL GOMEZ MORIN", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "LA VíCTIMA, DE ENTRE LOS 20 Y 25 AñOS DE EDAD, SE ENCONTRABA EN EL SITIO CUANDO UN INDIVIDUO SE LE PROXIMó Y REALIZó VARIOS DISPAROS A LA CABEZA. ", backup_file: nil, source: "http://laopcion.com.mx/noticia/33762/lo-ejecuta-mientras-caminaba-por-un-parque-en-juarez", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.3854968547821", latitude: "31.597910517573645", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-2 LO EJECUTAN MIENTRAS CAMINABA EN PARQUE (ZN JUáREZ)  NORTE HOMICIDIO LA VíCTIMA, DE ENTRE LOS 20 Y 25 AñOS DE EDAD, SE ENCONTRABA EN EL SITIO CUANDO UN INDIVIDUO SE LE PROXIMó Y REALIZó VARIOS DISPAROS A LA CABEZA.  A0-MEDIOS-2 LO EJECUTAN MIENTRAS CAMINABA EN PARQUE (ZN JUáREZ) NORTE HOMICIDIO LA VíCTIMA, DE ENTRE LOS 20 Y 25 AñOS DE EDAD, SE ENCONTRABA EN EL SITIO CUANDO UN INDIVIDUO SE LE PROXIMó Y REALIZó VARIOS DISPAROS A LA CABEZA.  A036 LO EJECUTAN MIENTRAS CAMINABA EN PARQUE (ZN JUáREZ) NOR