  {priority_id: 10000, event_date: "2014-04-05 05:20:01", description: "INTENTAN EJECUTAR A POLICíA (ZN JUáREZ)\r\n\r\nUN AGENTE DE LA POLICÍA MUNICIPAL FUE BALACEADO ENTRADA LA NOCHE EN VIALIDADES DEL FRACCIONAMIENTO JARDINES PANAMERICANA.\r\nEL OFICIAL SE ENCONTRABA FUERA DE TURNO Y SE DIRIGÍA EN AUTOMÓVIL A SU DOMICILIO, ACOMPAÑADO POR OTRO PATRULLERO, CUANDO OCURRIÓ EL ATAQUE EN EL CRUCE DE CALLES CAMPANILLAS Y ORTIGA, A LAS 23:20 HORAS APROXIMADAMENTE.\r\nLA INFORMACIÓN NO OFICIAL INDICA QUE LOS PISTOLEROS SE TRASLADABAN EN DOS CAMIONETAS.\r\nEL AFECTADO PRESENTABA AL MENOS UN IMPACTO DE BALA Y FUE HOSPITALIZADO EN CONDICIÓN DE SALUD NO CONOCIDO.\r\n", address: "CAMPANILLAS Y ACANTO", suburb: "JARDíN PANAMERICANO", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "EL OFICIAL SE ENCONTRABA FUERA DE TURNO Y SE DIRIGíA EN AUTOMóVIL A SU DOMICILIO, ACOMPAñADO POR OTRO PATRULLERO, CUANDO OCURRIó EL ATAQUE. SE SALIó UNA PERSONA DEL VEHíCULO, AL PARECER ARRASTRáNDOSE, ESCUCHO 6 DISPAROS, ES UN SATURNO DE COLOR AZUL OSCURO, CON UN PERMISO PEGADO EN EL VIDRIO. ES AGENTE MUNICIPAL, Y ESTá HERIDO. CUENTA CON IMPACTOS DE ARMA DE FUEGO Y ASí MISMO FUE TRASLADADO AL POLI PLAZA.", backup_file: nil, source: "http://laopcion.com.mx/noticia/34616/intentan-ejecutar-a-un-policia-en-juarez", area_id: 10000, crime_id: 10000, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.44533157348633", latitude: "31.623731613449724", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-2 INTENTAN EJECUTAR A POLICíA (ZN JUáREZ) CAMPANILLAS Y ACANTO NORTE HOMICIDIO EN TENTATIVA EL OFICIAL SE ENCONTRABA FUERA DE TURNO Y SE DIRIGíA EN AUTOMóVIL A SU DOMICILIO, ACOMPAñADO POR OTRO PATRULLERO, CUANDO OCURRIó EL ATAQUE. SE SALIó UNA PERSONA DEL VEHíCULO, AL PARECER ARRASTRáNDOSE, ESCUCHO 6 DISPAROS, ES UN SATURNO DE COL