  {priority_id: 10000, event_date: "2014-04-20 08:00:48", description: "EJECUTAN A ENCARGADO Y CAJERA DE BAR (ZN JUAREZ)\r\n\r\nEL ENCARGADO Y LA CAJERA DE UN BAR FUERON ASESINADOS A BALAZOS EN LOS PRIMEROS MINUTOS DE LA MADRUGADA, EN CÉNTRICAS CALLES DE LA CIUDAD.\r\nEL DOBLE ASESINATO OCURRIÓ A LA UNA Y MEDIA DE LA MAÑANA DENTRO DEL BAR “WEREVER”, UBICADO EN EL CRUCE DE LAS CALLES VICENTE GUERRERO Y COLOMBIA DE LA COLONIA EL BARREAL.\r\nERAN MADRE E HIJO, TENÍAN POCO TIEMPO CON EL BAR “WEREVER” Y TRABAJABAN SOLAMENTE CON UNA EMPLEADA.\r\nLAS PRIMERAS INVESTIGACIONES INDICAN QUE FUERON EJECUTADOS POR UN GRUPO DELICTIVO QUE LOS PRESIONABA PARA QUE VENDIERAN DROGA EN EL ANTRO.\r\n\r\nSE LLAMABAN  MARÍA TOMASA MARTÍNEZ DE LA CERDA, QUIEN TENÍA 52 AÑOS Y SU HIJO JAIME HUMBERTO PÉREZ MARTÍNEZ, DE 29.\r\n\r\nSICARIOS  LOS MATARON A BALAZOS CERCA DE LAS DOS DE LA MADRUGADA.\r\nSE ESTABLECIÓ QUE FUERON DOS PISTOLEROS LOS QUE ENTRARON AL BAR CON ARMAS CALIBRE 9 Y 45.\r\n", address: "VICENTE GUERRO Y COLOMBIA", suburb: "CENTRO", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "EL ENCARGADO Y UNA CAJERA DEL 'BAR WEREVER' UBICADO EN LA COLONIA EL BARREAL, FUERON EJECUTADOS A TIROS DURANTE LA MADRUGADA EN ESTA CIUDAD FRONTERIZA. SE DESCONOCEN LAS CARACTERíSTICAS DE LOS HOMICIDAS Y LA FORMA EN LA QUE ESCAPARON DEL SITIO.\r\n", backup_file: nil, source: "http://laopcion.com.mx/noticia/36680/ejecutan-a-encargado-y-cajera-de-bar-en-juarez", area_id: 10000, crime_id: 1, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status_id: 10023, longitude: "-106.4695143699646", latitude: "31.7352117181118", gmaps: nil, tramo_carretero: nil, searchable: "  A0-MEDIOS-2 EJECUTAN A ENCARGADO Y CAJERA DE BAR (ZN JUAREZ) VICENTE GUERRO Y COLOMBIA NORTE HOMICIDIO EL ENCARGADO Y UNA CAJERA DEL 'BAR WEREVER' UBICADO EN LA COLONIA EL BARREAL, FUERON EJECUTADO