  {priority_id: 10001, event_date: "2014-04-10 01:30:09", description: "LESIONADO POR ARMA DE FUEGO \r\nLA PAREJA DETENIDA  TRAS UNA PERSECUCIÓN PARA  EJECUTAR A UN MECÁNICO EN LA COLONIA SAFARI, ES RESPONSABLE DE HOMICIDIOS Y ASALTOS COMETIDOS EN EL SURORIENTE DE LA CIUDAD, INFORMO LA FISCALÍA GENERAL DEL ESTADO.\r\nSE TRATA DE NEREIDA MUÑOZ MUÑOZ, DE 27 AÑOS Y SU NOVIO HUMBERTO AVALOS NEVÁREZ, DE 26, QUIENES PORTABAN UNA PISTOLA CALIBRE 9 MILÍMETROS.\r\nELLOS ATACARON A BALAZOS UN MECÁNICO QUE SE NEGÓ A REPARARLES UNA CAMIONETA  ROBADA.\r\nEL HECHO OCURRIÓ EN UN LOCAL DE LA CALLE ELEFANTE, CERCANA AL EJE VIAL JUAN GABRIEL, POR DONDE PASABAN AGENTES MINISTERIALES QUE ESTUVIERON A LOS MALANDROS.\r\nLA POLICÍA MINISTERIAL ASEGURÓ UNA HYUNDAI SANTA FE AZUL MODELO 2000 ROBADA EN EL MES DE MARZO Y OTRA SATURN VUE GRIS, MODELO 2003 ROBADA EN ENERO PASADO.\r\nLA FISCALÍA LOS RESPONSABILIZA DE CUANDO MENOS CUATRO EJECUCIONES Y EL ASALTO A VARIOS NEGOCIOS DE COMIDA RÁPIDA Y UNA FARMACIA BENAVIDES DE LA AVENIDA DE LAS TORRES.\r\n", address: "LUCHA Y TRIUNFO ESQ. ELEFANTE ", suburb: "DEL SAFARI", locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "CUANDO LA VICTIMA Y SU ACOMPAñANTE LEGARON AL CRUCE DE LAS CALLES BARRANCO AZUL Y EJE JUAN GABRIEL SE IMPACTARON CONTRA OTRO VEHíCULO Y FUERON ALCANZADOS POR LOS SICARIOS NUEVAMENTE.\r\nESTOS DISPARARON CONTRA SUS VíCTIMAS NUEVAMENTE PERO FUERON ENFRENTADOS POR UN COMANDANTE DE LA POLICíA MINISTERIAL Y SU ESCOLTA, QUIENES DISPARARON Y PERSIGUIERON A LOS ATACANTES HASTA LA COLONIA HACIENDA DE LAS TORRES DONDE FUERON CAPTURADOS POR LO MENOS DOS HOMBRES Y UNA MUJER CON UN BEBé. (MEDIOS)\r\n", backup_file: nil, source: "http://www.omnia.com.mx/noticias/fuerte-enfrentamiento-de-ministeriales-contra-sicarios/", area_id: 10000, crime_id: 10000, township_id: 38, locality_id: nil, place_id: nil, analyst_id: 38, status