  {priority_id: 10000, event_date: "2014-04-15 18:12:57", description: "HALLAN MUERTO A SEMINARISTA SECUESTRADO: ARZOBISPO (ZC CHIHUAHUA)", address: nil, suburb: nil, locality: nil, victims: nil, detained: nil, suspects: nil, person_id: nil, vehicles: nil, vehicle_id: nil, drugs: nil, drug_id: nil, weapons: nil, weapon_id: nil, observations: "AL POCO TIEMPO DE DENUNCIAR EL SECUESTRO DEL SEMINARISTA SAMUEL GUSTAVO GóMEZ, EL ARZOBISPO DEL ESTADO DE CHIHUAHUA, CONSTANCIO MIRANDA WECKMANN, EXPRESó EN MISA QUE EL CUERPO SIN VIDA DEL JOVEN DE 21 AñOS FUE LOCALIZADO SIN VIDA. PREVIAMENTE HABíA HECHO UN PRONUNCIAMIENTO A SUS CAPTORES PARA QUE TUVIESEN MISERICORDIA DE éL Y LO ENTREGARAN CON VIDA.\r\nEL PRELADO NO DIO MáS DETALLES DEL CASO, SóLO COMENTó QUE YA SE HABíA CONTACTADO CON EL PRESIDENTE DE LA REPúBLCA MEXICANA, ENRIQUE PEñA NIETO, Y CON EL GOBERNADOR DEL ESTADO DE CHIHUAHUA, CéSAR HORACIO DUARTE JáQUEZ, PARA QUE TOMEN LAS ACCIONES NECESARIAS.\r\nMIRANDA WECKMANN DIJO QUE EL JOVEN CURSA EL PRIMER GRADO DE TEOLOGíA Y ES PARTE DE LA PARROQUIA DE LA DIVINA PROVIDENCIA; ADEMáS, EXTENDIó UNAS PALABRAS A LOS PADRES DEL JOVEN SAMNUEL, GUSTAVO Y NORMA, EN LAS CUALES LES ASEGURó QUE LA IGLESIA SIEMPRE ESTARá CON ELLOS.\r\nPOR SU PARTE LA FISCALíA GENERAL DEL ESTADO INFORMó QUE LA MUERTE DEL SEMINARISTA SAMUEL GUSTAVO GóMEZ FUE DURANTE UN ASALTO VIOLENTO, AUNQUE NO SE ESPECIFICó LA FECHA DEL SUCESO NI EL LUGAR.\r\nASIMISMO, LA DEPENDENCIA AFIRMó QUE HAY UNA PERSONA DETENIDA EN CALIDAD DE SOSPECHOSA.\r\n\r\nPOR OTRA PARTE SE RECIBIó UNA LLAMADA AL 066 A LAS 13:16 HRS DE ESTE DIA, EN LA CUAL SE SOLICITABA APOYO, AQUí EL REPORTE:\r\nEN LAS OFICINAS DE LA CATEDRAL, ESTá LA FAMILIA DE UN SEMINARISTA QUE SECUESTRARON AYER Y LO ASESINARON AHORITA SOLICITA APOYO DE UNIDAD DE MINISTERIAL COMO RESGUARDO PARA LLEVAR A SU FAMILIA A LA COL. INFONAVIT ESTO COMO SEGURIDAD PARA LA FAMILIA, SOLICITA QUE LLEGUEN A LAS OFICINAS DE LA CATEDRAL SIN TORRETAS.\r\n", backup_file: nil, source: "http: